INSERT INTO `cms_faq` (`id`, `question`, `answer`) VALUES
(1, 'Devo verificare i dati di una persona cosa devo fare?', 'Per verificare i dati anagrafici clicca qui <a href=\"https://www.liveforever.cloud/test/public/index.php/admin/persona/index?to_verify=1&hide_search_form=1\">Da Verificare</a>'),
(2, 'Una persona sta realizzando il suo albero genealogico ma devo verificare le relazioni, come faccio?', 'La persona che ha il profilo con restrizioni non può confermare per suo conto le relazioni che dichiara verso altre persone ma serve il consenso o dell\'amministratore o dell\'altra persona. Se vuoi confermare una relazione alloca <a href=\"https://www.liveforever.cloud/test/public/index.php/admin/persona/index?with_relations_to_verify=1&hide_search_form=1\">Clicca qui</a>'),
(3, 'Come posso modificare la mail che arriva agli utenti quando hanno smarrito la loro password?', 'I modelli di mail che vengono inviati agli utenti si trovano sotto la voce gestisci > mail. Un modello è caratterizzato da un soggetto e da un corpo. Il corpo può contenere una struttura html e può essere composto da segnaposto che vengono sostituiti da informazioni dinamiche come ad esempio il nome o il cognome di una persona o la password inviata. Per modificare mail che richiedi <a href=\"https://www.liveforever.cloud/test/public/index.php/admin/mail/edit/3\">Clicca qui</a>'),
(4, 'Ho sbagliato ad inserire la mail di una persona come faccio?', 'Per modificare la mail di una persona inserita erroneamente clicca su Tutte le anagrafiche oppure su aggiunte dallo staff (se l\'inserimento è avvenuto tramite il backoffice). Una volta individuata la persona cliccare su modifica.<br/>\r\nLateralmente alla form di modifica dei dati compaiono una serie di pulsanti e link. Cliccare su Modifica Account persona<br>\r\nIn questa form potrai cambiare la mail e digitare la nuova password.<br>\r\nSe spunterai la voce Invia la nuova password alla persona allora il sistema invierà la nuova password con la mail con soggetto \"Accedi a LiveForever con la tua nuova password\".\r\n, diversamente dovrai comunicare personalmente la nuova password'),
(5, 'Come faccio a modificare mail e testo mostrato all\'utente che chiede di diventare ARCHIVISTA?', 'La mail si modifica al seguente indirizzo:\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/mail/edit/13\r\n<br>\r\nle pagine da modificare sono due :\r\n<br>\r\nTi stai candidando come archivista	: contiene tutto il testo mostrato all\'utente che precede la form di invio dei dati\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/cmspage/edit/743\r\n<br>\r\nTi sei candidato come archivista : contiene tutto il testo mostrato all\'utente dopo l\'invio dei dati<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/cmspage/edit/742<br>'),
(6, 'Come faccio a modificare la pagina sponsor e la mail che arriva?', 'La mail si modifica al seguente indirizzo:\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/mail/edit/14\r\n<br>\r\nle pagine da modificare sono due :\r\n<br>\r\nSponsor	: contiene tutto il testo mostrato all\'utente che precede la form di invio dei dati\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/cmspage/edit/740\r\n<br>\r\nGrazie per aver inviato la tua candidatura come sponsor : contiene tutto il testo mostrato all\'utente dopo l\'invio dei dati\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/cmspage/edit/744'),
(7, 'Dove gestisco la pagina delle Iniziative', 'Incolla sul browser questo indirizzo\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/admin/cmspage/edit/745'),
(8, 'Nelle pagine che consentono all\'utente di impostare il template di albero genealogico e , poi, nelle pagine di selezione e rimozione delle persone compaiono dei testi. Come li modifico?', 'Questi sono i link per modificare queste pagine<br><br>\r\n<br>\r\nQuesta che \"Imposta o cambia albero genealogico personalizzato\"<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/753<br>\r\n<br><br>\r\nQuesta \"Visualizza le persone presenti nell\'albero genealogico\"<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/752<br>\r\n<br><br>\r\nQuesta  \"Consente di scegliere le persone da includere in albero genealogico\"<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/751<br>'),
(9, 'Quali pagine devo modificare per cambiare i testi che l\'utente vede quando ordina fiori o cuori?', 'Le pagine da modificare sono quelle sotto riportate\r\n<br><br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/758\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/756\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/757\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/754\r\n<br>\r\nhttps://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/755\r\n<br>'),
(10, 'Quali pagine devo modificare quando una persona paga per inserire una nuova scheda anagrafica?', 'Le pagine da modificare sono accessibili attraverso le url che seguono:<br><br>\r\n<a href=\"https://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/761\">Testo che compare come ringraziamento dopo il pagamento</a><br>\r\n<br>\r\n<a href=\"https://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/760\">Testo che compare quando la persona ha deciso di pagare per inserire la scheda anagrafica dell\'amico o conoscente o familiare</a><br>\r\n<br>\r\n<a href=\"https://www.liveforever.cloud/public/index.php/webapp/admin/cmspage/edit/759\">Testo che spiega all\'utente perchè deve pagare l\'inserimento della scheda anagrafica</a><br>');
