(1, '2022-08-05 15:28:07', '2024-03-17 11:05:44', 'Chi siamo.', 'about us.', 'about us', 'about us.', '<p>Mi chiamo Mauro Pompetti, sono un tecnico curioso e talvola testardo. La mia compagna Giovanna mi parla spesso di suo padre Antonio, deceduto molti anni fa, e di suo fratello Beniamino, anche lui deceduto prematuramente pochi anni fa. Ho desiderato intensamente di incontrarli, vuoi per condividere appieno i racconti di Giovanna, vuoi per la curiosit&agrave; di conoscere due grandi. Purtroppo non posso e questa parola ha mosso in me profonde riflessioni prima della ricerca di una soluzione.</p>\r\n\r\n<p>Un vecchio mantra indiano, utile per quelli che sentono di avere grossi problemi, ci propone un semplice esercizio: pensiamoci morti nella nostra bara e pensiamo al nostro dramma, ora pensiamo al nostro corpo tra 10 anni e vediamo il nostro dramma in un altra luce, ora se lo pensiamo tra 100 anni il nostro dramma, per doloroso che possa essere, diventa insignificante in quanto non c&#39;&egrave; nessuno al mondo che si ricorder&agrave; di noi o di quello che ci riguarda.</p>\r\n\r\n<p>Insomma passate 3 generazioni le persone non si possono conoscere e quindi sapere gli uni degli altri. Miliardi di persone, un intero pianeta, vive mediamente per 70 anni e dopo 70 anni dalla morte sparisce.&nbsp;</p>\r\n\r\n<p>Vedo in epici racconti lo sforzo di Achille di compiere geste eroiche per essere ricordato nei secoli ed in tempi pi&ugrave; attuali persone speciali che hanno contribuito a migliorare il mondo con idee, invenzioni, scoperte. Molti dei&nbsp;loro nomi vengono e forse verranno ricordati per sempre.</p>\r\n\r\n<p>Qui nasce l&#39;idea di Liveforever di estendere ed ampliare questo privilegio, un archivio che contiene le informazioni caratterizzanti di ogni individuo e le sue correlazioni di sangue, d&#39;amore e delle grandi amicizie con gli altri. Un archivio che per la sua forma digitale pu&ograve; contenere filmati e ci permette di conoscere l&#39;individuo come in un film.</p>\r\n\r\n<p>Le correlazioni potranno permettere ad un pronipote tra 900 anni di risalire ad un suo avo&nbsp;partendo dai suoi genitori e navigando per bis bis bis nonni fino a lui e conoscerlo dal vivo, vedere come parla, come era, cosa ha fatto, ascoltare i suoi consigli, divertirsi con le sue previsioni per il futuro, trovare analogie e somiglianze con se stesso.</p>\r\n\r\n<p>Il progetto &egrave; molto grosso ed il team al momento &egrave; composto da:</p>\r\n\r\n<p>Ing.Mauro Pompetti creatore e CEO</p>\r\n\r\n<p>Avv.Gianluca Pomante per la parte legale</p>\r\n\r\n<p>Francesco Protano&nbsp; sviluppatore della piattaforma web</p>\r\n\r\n<p>Dott.Mario Pompetti per il marketing</p>\r\n\r\n<p>Dott.ssa Ilaria Maganza per marketing e vendite</p>', '<p>My name is Mauro Pompetti, I am a curious and sometimes stubborn technician. My partner Giovanna often talks to me about her father Antonio, who died many years ago, and her brother Beniamino, who also died prematurely a few years ago. I intensely wanted to meet them, either to fully share Giovanna&#39;s stories, or out of curiosity to meet two greats. Unfortunately I can&#39;t and this word prompted deep reflections in me before searching for a solution.</p>\r\n\r\n<p>An old Indian mantra, useful for those who feel they have big problems, offers us a simple exercise: let&#39;s think of ourselves dead in our coffin and think about our drama, now let&#39;s think about our body in 10 years and see our drama in a different light, now if we think about it in 100 years our drama, however painful it may be, becomes insignificant as there is no one in the world who will remember us or what concerns us.</p>\r\n\r\n<p>In short, after 3 generations people cannot know each other and therefore know about each other. Billions of people, an entire planet, live on average for 70 years and disappear 70 years after death.</p>\r\n\r\n<p>Here the idea of ​​Liveforever was born, an archive that contains the interesting information of every individual who desires it and the correlations of blood, love and great friendships with others.</p>\r\n\r\n<p>It will be precisely these relationships that will allow a great-grandchild in 900 years to trace back to me starting from his parents and navigating through great-great-great grandparents to me.</p>\r\n\r\n<p>The project is very big and the team currently consists of:</p>\r\n\r\n<p>Ing.Mauro Pompetti creator and CEO</p>\r\n\r\n<p>Attorney Gianluca Pomante for the legal part</p>\r\n\r\n<p>Francesco Protano&nbsp;&nbsp;developer of the web platform</p>\r\n\r\n<p>Dr.Mario Pompetti for marketing</p>', NULL, '20231219062219-logo.png', NULL, 'chi-siamo', 2, 1, 0, 0, 1, 1),
