(727, '2023-11-22 09:04:04', '2024-03-23 09:37:59', 'Il progetto.', 'The idea.', 'The idea', 'The idea.', '<h1><h1]> Il progetto.</h1]></h1>\r\n\r\n<p>Questa piattaforma mira a contenere le informazioni pi&ugrave; importanti degli abitanti del pianeta e le correlazioni tra di essi da ricordare per sempre.</p>\r\n\r\n<p>Un grande albero genealogico dove &egrave; semplice navigare attraverso le relazioni parentali, d&#39;amore o di amicizia, che si aggiorna&nbsp;con i nuovi nati, con i decessi e con nuove informazioni multimediali individuali.</p>\r\n\r\n<p>Dopo il decesso verranno resi visibili le informazioni scelte dall&#39;utente ed in particolare un video multimediale chiamato &#39;Life extention&#39; della durata di circa 3 minuti dove l&#39;utente riassume col suo volto e la sua voce i passi cruciali della sua vita e da un suo personale consiglio ai suoi pronipoti. &nbsp;</p>\r\n\r\n<p>Il video life extention resta&nbsp;visibile per la durata acquistata dal soggetto con costi dell&#39;ordine di un migliaio di euro a secolo. I posteri potranno prolungarne la visibilit&agrave; regalando altro tempo, senza limiti.</p>\r\n\r\n<p>La prerogativa principale di questa piattaforma &egrave; la durata teoricamente infinita nel tempo e con essa la sopravvivenza nei secoli delle informazioni pi&ugrave; importanti di tutti gli individui registrati.</p>\r\n\r\n<p>La piattaforma &egrave; rivolta a tutti &nbsp;e quindi anche a te, coloro che non gradiscono essere identificati e, sono inseriti da terzi legati ad essi, avranno i dati oscurati che saranno visibili solo quando vorranno.</p>\r\n\r\n<p>La presenza per sempre nella piattaforma &egrave; in questo momento gratuita.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Perch&egrave; iscriverti?</p>\r\n\r\n<p>1) Per lasciare una traccia di te anche tra molti secoli</p>\r\n\r\n<p>2) Per lasciare un messaggio per i pronipoti che non vedremo mai</p>\r\n\r\n<p>3) Per rintracciare o essere rintracciati facilmente da parenti sconosciuti e se possibile comunicare con essi. Pu&ograve; essere molto eccitante pianificare viaggi per LiveForever incontrare un cugino oltremare di cui godere della compagnia durante una bella vacanza.</p>\r\n\r\n<p>4) Per rintracciare e poter conoscere qualunque persona estinta anche da molto tempo, tramite i legami parentali.</p>\r\n\r\n<p>5) La piattaforma ti informer&agrave; delle nuove nascite e dei eventuali decessi relativi a parenti anche non troppo vicini.</p>\r\n\r\n<p>6) L&#39;iscrizione e l&#39;inserimento dei propri genitori, dei propri nonni rappresenta un emozionante momento di ricerca e condivisione delle informazioni nella propria famiglia.</p>\r\n\r\n<p>7) Per essere informati di compleanni ed onomastici di tutte le persone a te care.</p>\r\n\r\n<p>8)&nbsp; Per potere omaggiare e onorare i nostri cari defunti tramite fiori o opere di bene direttamente sul web o per aiutare la promozione tramite il versamento del 5 x 1000 sul cc 94094080713</p>\r\n\r\n<p>Emergeranno e, faremo tornare in vita nelle nostre menti, parenti dimenticati e poco nominati.</p>\r\n\r\n<p><strong>Come iscriverti?</strong></p>\r\n\r\n<p>Ci sono vari livelli di partecipazione al progetto.</p>\r\n\r\n<p><strong>1) Utente non registrato.&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Vedere l&#39;albero genealogico di tutte le persone registrate</li>\r\n	<li>Navigare per collegamento</li>\r\n	<li>Visualizzare i soli dati concessi dalla privacy di ogni membro</li>\r\n	<li>Rivendicare il profilo inserito da un altro come proprio</li>\r\n	<li>Pu&ograve;&nbsp;segnalare errori o abusi&nbsp;</li>\r\n	<li>Pu&ograve; visualizzare: la storia e gli autori del progetto, la strategia di immissione e conservazione dei dati, i criteri di privacy, pu&ograve; vedere le donazioni sui profili</li>\r\n</ul>\r\n\r\n<p><strong>2) Utente registrato</strong></p>\r\n\r\n<p>E&#39; colui che si registra&nbsp;in maniera completa: mail verificata, telefono verificato, codice fiscale verificato, foto e poi possono inserire la loro famiglia ed i loro amici.&nbsp;<br />\r\nHanno sempre autorizzazione di inserire nuovi membri collegati ad essi e di modificare collegamenti e dati.<br />\r\nNon possono agire su profili e collegamenti non inseriti da loro.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>3) Archivista</strong></p>\r\n\r\n<p>Sono coloro che si registrano in maniera completa: mail verificata, telefono verificato, codice fiscale verificato, foto e fanno domanda di contribuire alla piattaforma diventando archivisti. Se accettati &nbsp;possono inserire tutti senza alcuna limitazione.<br />\r\nHanno sempre autorizzazione di inserire nuovi membri e di modificare collegamenti e dati.<br />\r\nNon possono agire su profili e collegamenti non inseriti da loro. Contribuiscono a risolvere le dispute su dati inseriti da loro, abilitano gli utenti che rivendicano il loro profilo e di cui non era stata inserita la mail.&nbsp;</p>\r\n\r\n<p><strong>Che documenti inserire per ogni utente?</strong></p>\r\n\r\n<p>Oltre ai dati anagrafici e geografici di ogni utente che possiamo reperire chiedendoli direttamente a lui o hai parenti pi&ugrave; prossimi se non c&#39;&egrave; pi&ugrave; ci sono tre tipi di documenti da preparare:</p>\r\n\r\n<p>Una foto per il profilo e qualche altra foto caratteristica</p>\r\n\r\n<p>Uno scritto in pdf con il curriculum della persona</p>\r\n\r\n<p>Un video che chiamiamo &#39;Life estention&#39; della durata di massimo 3 minuti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Come fare un video life extention?</p>\r\n\r\n<p>Rispondi davanti ad una telecamera, in un posto silenzioso e ben illuminato alle seguenti domande:</p>\r\n\r\n<p>1) Come ti chiami?</p>\r\n\r\n<p>2) Che giorno &egrave; oggi?</p>\r\n\r\n<p>3) Come si chiamano i tuoi genitori e come sei stato con loro?</p>\r\n\r\n<p>4) Come si chiamano i tuoi figli e l&#39;affetto che provi per loro?</p>\r\n\r\n<p>5) Quali sono le tue passioni ed i tuoi sogni?</p>\r\n\r\n<p>6) Qual&#39;&egrave; stato l&#39;evento pi&ugrave; brutto della tua vita?</p>\r\n\r\n<p>7) Qual&#39;&egrave; stato l&#39;evento pi&ugrave; bello della tua vita?</p>\r\n\r\n<p>8) Cosa prevedi accadr&agrave; nel futuro del pianeta?</p>\r\n\r\n<p>9) Che messaggio/consiglio vuoi lasciare a chi vedr&agrave; questo video?</p>\r\n\r\n<p>Poi se volete far lasciare un messaggio pi&ugrave; profondo e caratterizzante, fate riflettere e poi sottoponete le seguenti domande:</p>\r\n\r\n<p dir=\"ltr\">10) Cosa ami? (Passione)</p>\r\n\r\n<p dir=\"ltr\">11) In che cosa sei bravo? (Professione)</p>\r\n\r\n<p dir=\"ltr\">12) Di cosa ha bisogno il mondo che tu puoi dare? (Missione)</p>\r\n\r\n<p dir=\"ltr\">13) Per cosa puoi&nbsp;essere ricompensato? (Vocazione)</p>\r\n\r\n<p>I video non possono durare pi&ugrave; di 3&nbsp;minuti. Puoi decidere di renderli visibili subito oppure quando non ci sei pi&ugrave;, a tutti o solo ai tuoi discendenti.</p>\r\n\r\n<p>Per i prossimi 50 anni il video star&agrave; gratuitamente in piattaforma, per tempi pi&ugrave; lunghi &egrave; possibile con un costo di 9&nbsp;euro per il numero di anni di visibilit&agrave;</p>', '<h1>The project.</h1>\r\n\r\n<p>This is a platform that aims to contain the information to remember of the inhabitants of the planet and the correlations between them.</p>\r\n\r\n<p>A large family tree where it is easy to navigate through parental, love or friendship relationships, which is updated with new births, deaths and new individual multimedia information.</p>\r\n\r\n<p>After death, the information chosen by the user will be made visible and in particular a multimedia video called &#39;Life extension&#39; lasting approximately 3 minutes where the user summarizes with his face and voice the crucial steps of his life and from a his personal advice to his great-grandchildren.</p>\r\n\r\n<p>The life extension video remains visible for the duration purchased by the subject with costs in the order of a thousand euros per century. Posterity will be able to prolong its visibility by giving away more time, without limits.</p>\r\n\r\n<p>The main prerogative of this platform is its theoretically infinite duration over time and with it the survival over the centuries of the most important information of all registered individuals.</p>\r\n\r\n<p>The platform is aimed at everyone and therefore also at you, those who do not like to be identified and, are inserted by third parties linked to them, will have their data obscured which will only be visible when they want.</p>\r\n\r\n<p><br />\r\nWork on the creation of the platform is underway, soon a large group of people will be able to independently join and include their loved ones.<br />\r\nPresence on the platform forever is free.</p>\r\n\r\n<p>Why sign up?</p>', NULL, '20240315091719-fotolia_7850876_xs.jpg', 2, 'il-progetto', 2, 1, 0, 0, 1, 1),
