(734, '2023-12-10 08:22:32', '2024-03-23 10:30:11', 'Privacy.', 'Privacy.', 'Privacy', 'Privacy.', '<p>I contenuti appresi in questo sito devono essere trattati come strettamente confidenziali e finalizzati al bene dell&#39;utilizzatore e di tutti&nbsp; membri.</p>\r\n\r\n<p>Quando si&nbsp;inseriscono le persone a noi collegate dobbiamo verificare la loro volont&agrave; di palesare le informazioni. Il programma mantiene le informazioni nascoste fino a 50 anni dopo il decesso.&nbsp;</p>\r\n\r\n<p>Se un utente si ritrova inserito ma non condivide la volont&agrave; di essere presente sulla piattaforma pu&ograve; iscriversi e cancellarsi o chiedere di essere rimosso al webmaster. Saranno cos&igrave; rimossi tutti i collegamenti che lo riguardano.</p>\r\n\r\n<p>Ciascun utente iscrivendosi al sito pu&ograve; autonomamente modificare o aggiungere i propri dati e modificare il consenso alla visualizzazione degli stessi.&nbsp;</p>\r\n\r\n<p>&nbsp;Se si riscontrano errori sui dati di altre persone &egrave; possibile farne segnalazione al team di controllo.</p>', '<p>The contents learned on this site must be treated as strictly confidential and aimed at the good of the user and all members.</p>\r\n\r\n<p>When we&nbsp;include people connected to us we must verify their willingness to reveal the information. The program keeps information hidden for up to 50 years after death.</p>\r\n\r\n<p>If a user finds himself added but does not share the desire to be present on the platform, he can register and unsubscribe or ask the webmaster to be removed. All links relating to him will thus be removed.</p>\r\n\r\n<p>By registering on the site, each user can independently modify or add their own data and modify their consent to the viewing of the same.</p>\r\n\r\n<p>If you find errors in other people&#39;s data you can report them to the control team.</p>', NULL, NULL, NULL, 'privacy', NULL, 1, 0, 0, 1, 0),
(735, '2023-12-23 16:23:53', '2024-01-27 17:57:42', 'grazie per esserti registrato sul sito', 'Thank you to stay with us', 'Thank you to stay with us', 'Thank you to stay with us', '<p>Grazie per esserti registrato sul sito. In questo momento, stiamo verificando i dati che ci hai inviato. Grazie e buona giornata</p>', '<p>Thank you for registering on the site. We are currently verifying the data you sent us. Thank you and good day</p>', 'user-register-seo-success', NULL, NULL, 'grazie-per-esserti-registrato-sul-sito', NULL, 1, 0, 0, 1, 1),
