(737, '2024-01-19 19:22:08', '2024-02-03 00:32:18', 'Ricerca partner e collaboratori.', 'Employers and partner research', 'Ricerca partner e collaboratori.', 'Employers and partner research.', '<p><strong>Cerchiamo collaboratori, sviluppatori, personale per il team di sviluppo e lancio della piattaforma con contratti di partership o collaborazione.<br />\r\nMandare i curriculi alla mail&nbsp;</strong><a href=\"mailto:pompetti@dpmelettronica.it\">pompetti@dpmelettronica.it</a></p>', '<p>We are looking for collaborators, developers, personnel for the development and launch team of the platform with partnership or collaboration contracts.<br />\r\nSend your CVs to the email&nbsp;pompetti@dpmelettronica.it</p>', NULL, NULL, 1, 'ricerca-personale', NULL, 1, 0, 0, 1, 1),
(738, '2024-01-20 09:42:18', '2024-03-23 10:29:13', 'Protezione delle informazioni.', 'Information protection', 'Information protection', 'Information protection', '<h1>Privacy.</h1>\r\n\r\n<p><strong>Liveforever &egrave; il tuo strumento ideale per riunire in un unico posto le persone a te care. Puoi inserire tutti, persone che non sanno usare la piattaforma,&nbsp; altri che sono troppo giovani o troppo vecchi per farlo da soli, altri che non ci sono pi&ugrave; ed altri ancora che come te sono attivi sui social. Pertanto solo le persone attive potranno inserire informazioni personali proprie e quelle di altre persone.</strong></p>\r\n\r\n<p>Per rispettare completamente le leggi in tema di privacy il sito permette la scelta della visualizzazione delle informazioni sia riguardo ai contenuti che ai destinatari. Chi si assume il compito della compilazione dei dati ne &egrave; direttamente responsabile sia riguardo i contenuti sia riguardo la privacy della persona che sta inserendo.</p>\r\n\r\n<p>Chi inserisce i dati si deve assicurare della correttezza delle informazioni ma prima ancora se l&#39;interessato &egrave; consenziente a rendere pubblici i suoi dati ed in caso contrario coprire la visibilit&agrave; fino addirittura ad ometterne l&#39;inserimento.</p>\r\n\r\n<p>LiveForever ti consente pubblicare i tuoi&nbsp;dati e renderli visibili a tutti o restringere&nbsp;l&#39;ambito della loro visibilit&agrave;.</p>\r\n\r\n<p>La visibilit&agrave; delle informazioni inserite avviene su due livelli</p>\r\n\r\n<ul>\r\n	<li>Generale. riguarda tutti gli utenti del sito che non hanno alcuna&nbsp;relazione con te</li>\r\n	<li>Per relazione. Riguarda tutti gli utenti con cui tu hai confermato di avere una relazione&nbsp;</li>\r\n</ul>\r\n\r\n<p>In entrambi gli ambiti tu potrai stabilire in maniera minuziosa quali delle informazioni saranno visibili.</p>\r\n\r\n<p>Crtieri Generali</p>\r\n\r\n<p>Vengono applicati a tutti gli utenti che non hanno alcuna relazione con te. Loro potranno vedere solo le informazioni che tu hai deciso.</p>\r\n\r\n<p>Criteri per relazione.</p>\r\n\r\n<p>Vengono applicati a tutti gli utenti con cui tu hai confermato di avere una relazione. E&#39; un ambito pi&ugrave; stretto rispetto a quello generale e prevale sempre su du esso.</p>\r\n\r\n<p>Per capire come funzionano questi criteri ti spiego un caso di utilizzo pratico</p>\r\n\r\n<p>Il tuo obiettivo &egrave; rendere visibile la tua foto solo agli amici stretti</p>\r\n\r\n<p>Per fare questo dovrai fare i seguenti passi</p>\r\n\r\n<ol>\r\n	<li>Vai sulla privacy e vai sulla privacy generale. Togli la spunta a tutte le informazioni che vuoi nascondere inclusa la foto</li>\r\n	<li>Vai sulla privacy e vai sulla privacy per relazione. Naviga sulla pagina fino a trovare la voce &quot;Amici stretti&quot;</li>\r\n	<li>Togli la spunta a tutte le informazioni ecetto che sulla foto</li>\r\n</ol>\r\n\r\n<p>Il gioco &egrave; fatto! da questo istante solo i tuoi amici stretti potranno vedere la tua foto</p>\r\n\r\n<p>Successivamente ti rendi conto che anche tuo padre e tua madre devono vedere la tua foto. Bene.</p>\r\n\r\n<p>Torna sul punto 2 e cerca Madre e Padre e spunta la foto come prima</p>\r\n\r\n<p>Decidi tu cosa far vedere e a chi</p>\r\n\r\n<p>L&#39;ordine di applicazione dei nostri criteri di visibilit&agrave; avviene da generale verso particolare. Se non c&#39;&egrave; una regola particolare che supera quella generale allora viene applicata quella generale.</p>\r\n\r\n<p>Facciamo un esempio</p>\r\n\r\n<p>Sei andato sulla privacy generale e hai spuntato la voce codice fiscale. Attenzione: in questo caso stai rendendo pubblico il tuo codice fiscale!</p>\r\n\r\n<p>Chi naviga in maniera anonima sul sito&nbsp; e si imbatte sul tuo profilo vedr&agrave; il tuo codice fiscale!</p>\r\n\r\n<p><strong>Se comunque non desideri appartenere a questa comunit&agrave; per niente e desideri essere rimosso lo puoi chiedere a chi ti ha inserito o al webmaster.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ora te!&nbsp;</p>\r\n\r\n<p>Buona navigazione</p>\r\n\r\n<p>&nbsp;</p>', '<h1>Privacy</h1>\r\n\r\n<p><strong>Liveforever is your ideal tool for bringing the people you care about together in one place. You can include everyone, people who don&#39;t know how to use the platform, others who are too young or too old to do it on their own, others who are no longer around and still others who, like you, are active on social media. Therefore only active people will be able to enter their own personal information and that of other people.</strong></p>\r\n\r\n<p>To fully comply with privacy laws, the site allows the choice of displaying information regarding both contents and recipients. Whoever takes on the task of compiling the data is directly responsible both for the contents and for the privacy of the person entering.</p>\r\n\r\n<p>Whoever enters the data must ensure the correctness of the information but first of all whether the interested party consents to making his data public and otherwise cover the visibility to the point of even omitting the insertion.</p>\r\n\r\n<p>LiveForever allows you to publish your&nbsp;data and make it visible to everyone or narrow&nbsp;the scope of its visibility.</p>\r\n\r\n<p>The visibility of the information entered occurs on two levels</p>\r\n\r\n<p>General. concerns all users of the site who have no&nbsp;relationship with you<br />\r\nBy relationship. This concerns all users with whom you have confirmed having a relationship<br />\r\nIn both areas you will be able to establish in detail which information will be visible.</p>\r\n\r\n<p>General Criteria</p>\r\n\r\n<p>They apply to all users who have no relationship with you. They will only be able to see the information you have decided.</p>\r\n\r\n<p>Criteria for relationship.</p>\r\n\r\n<p>They are applied to all users with whom you have confirmed you have a relationship. It is a narrower scope than the general one and always prevails over it.</p>\r\n\r\n<p>To understand how these criteria work, I will explain a practical use case</p>\r\n\r\n<p>Your goal is to make your photo visible only to close friends</p>\r\n\r\n<p>To do this you will have to take the following steps</p>\r\n\r\n<p>Go to privacy and go to general privacy. Uncheck all the information you want to hide including the photo<br />\r\nGo to privacy and go to privacy by relationship. Navigate the page until you find the &quot;Close friends&quot; item<br />\r\nUncheck all information except the photo<br />\r\nThe game is done! from this moment only your close friends will be able to see your photo</p>\r\n\r\n<p>Later you realize that your father and mother must see your photo too. Well.</p>\r\n\r\n<p>Go back to point 2 and look for Mother and Father and check the photo as before</p>\r\n\r\n<p>You decide what to show and to whom</p>\r\n\r\n<p>The order of application of our visibility criteria is from general to specific. If there is no particular rule that overrides the general one then the general one is applied.</p>\r\n\r\n<p>Let&#39;s take an example</p>\r\n\r\n<p>You went to general privacy and ticked the tax code item. Warning: in this case you are making your tax code public!</p>\r\n\r\n<p>Anyone who browses the site anonymously and comes across your profile will see your tax code!</p>\r\n\r\n<p><strong>However, if you don&#39;t want to belong to this community at all and want to be removed, you can ask the person who added you or the webmaster.</strong></p>\r\n\r\n<p>Now you!</p>\r\n\r\n<p>Happy browsing</p>', NULL, '20240315091232-informazioni.jpg', 2, 'protezione-delle-informazioni', NULL, 1, 0, 0, 1, 1),
(739, '2024-02-03 00:31:22', '2024-03-15 09:22:48', 'Strategia di immissione e conservazione dei dati', 'Data retention and editing strategy', 'Data retention and editing strategy', 'Data retention and editing strategy', '<p>L&rsquo;idea di conservare i dati delle persone per una durata illimitata &egrave; complessa e ci ha portato ad&nbsp;affrontare i seguenti problemi:</p>\r\n\r\n<p>1) Scelta del supporto di memorizzazione compatto e duraturo<br />\r\n2) Col modificarsi della tecnologia trasferire gli archivi su supporti pi&ugrave; moderni<br />\r\n3) Conservare gli archivi in un posto con temperatura, umidit&agrave; e polvere controllati e sicuro da vandali.<br />\r\n4) Duplicare gli archivi e posizionarli in posti geograficamente lontani, cos&igrave; da proteggerli da eventi&nbsp;catastrofici<br />\r\n5) Avere una organizzazione che aggiorni i dati ed i programmi negli archivi che duri per sempre.<br />\r\n6) Avere una organizzazione che si autosostenga da un punto di vista economico per fare fronte alle&nbsp;spese.</p>\r\n\r\n<p><br />\r\n<strong>Utilizzare un supporto di memorizzazione compatto e duraturo</strong></p>\r\n\r\n<p><br />\r\nAl momento pare la tecnologia Blu-ray sia quella pi&ugrave; duratura come ritenzione dei dati. Una<br />\r\nesperienza diretta non &egrave; possibile perch&eacute; questi DVD sono stati sviluppati di recente ma prevedono&nbsp;durate ipotetiche e forse ottimistiche di 1000 anni.<br />\r\nPer un produttore come Milleniata &egrave; facile inserire una durata molto superiore a quella che sar&agrave;&nbsp;realisticamente la vita dell&rsquo;azienda stessa, pertanto prendiamo con una certa cautela dichiarazioni&nbsp;troppo ottimistiche.<br />\r\nAbbiamo deciso che dall&rsquo;inizio della vita del progetto Live forever, si partir&agrave; con l&rsquo;archiviazione dei&nbsp;dati su dischi Blu-ray, con la missione di rigenerare l&rsquo;archivio ogni 50 anni o prima se la tecnologia&nbsp;proporr&agrave; dispositivi pi&ugrave; vantaggiosi (e cos&igrave; rispondiamo al punto 2).<br />\r\nContemporaneamente i dati sono affidati al cloud, in particolare ad Aruba, leader in questo tempo,&nbsp;(e cos&igrave; rispondiamo al punto 4).<br />\r\nIn pi&ugrave; i dati vengono periodicamente inviati ad organizzazioni che si presuppone vivano per sempre&nbsp;con dati gestiti da chiese e organizzazioni statali.</p>\r\n\r\n<p><strong>Conservare gli archivi in un posto con temperatura, umidit&agrave; e polvere controllati</strong></p>\r\n\r\n<p><br />\r\nLa conservazione dei primi archivi, nella forma di DVD Blu-ray, avverr&agrave; nel contenitore originale&nbsp;che protegge dalla polvere ed in una cassaforte protetta da un sistema di allarme. La cassaforte &egrave;&nbsp;posizionata in un posto abitato, la temperatura e l&rsquo;umidit&agrave; non subiscono forti variazioni grazie ai&nbsp;sistemi di riscaldamento e condizionamento.</p>\r\n\r\n<p><br />\r\n<strong>Avere una organizzazione che aggiorni i dati ed i programmi negli archivi che duri per sempre.</strong></p>\r\n\r\n<p><br />\r\nAvere una organizzazione che aggiorni i dati ed i programmi negli archivi che duri per sempre &egrave; un&nbsp;obbiettivo alquanto impegnativo. Perch&egrave; una organizzazione duri sono necessari alcuni requisiti:<br />\r\n&bull; la presenza di un leader che motivi e gestisca l&rsquo;organizzazione<br />\r\n&bull; un sistema di ricambio del leader<br />\r\n&bull; un sistema di selezione e motivazione dei collaboratori<br />\r\n&bull; un certo profitto</p>\r\n\r\n<p><br />\r\nDa un punto di vista funzionale l&rsquo;organizzazione si divide in:</p>\r\n\r\n<p><br />\r\n<strong>Leader</strong>. Svolge le funzioni di gestione patrimoniale e finanziario. Presenzia lo staff di archivisti per&nbsp;le decisioni strategiche. E&rsquo; responsabile della conservazione dei dati.</p>\r\n\r\n<p><br />\r\n<strong>Staff di archivisti.</strong> Sono coloro abilitati a inserire i dati in maniera diretta, a gestire le segnalazioni&nbsp;di errore, correggere ed eliminare profili disturbatori o duplicati, prendere parte alla strategia della&nbsp;piattaforma. Sono gli unici che possono accedere al back office.</p>\r\n\r\n<p><br />\r\n<strong>Archivisti junior.</strong> Sono coloro che si registrano e poi inseriscono dati per se e per gli altri, sono&nbsp;abilitati all&rsquo;inserimento diretto dei dati. Contribuiscono a risolvere le dispute su dati inseriti da loro,&nbsp;abilitano gli utenti.</p>\r\n\r\n<p><br />\r\n<strong>Utenti</strong>. Sono coloro che si registrano e poi inseriscono la loro famiglia e con questo completano le&nbsp;loro attivit&agrave; in piattaforma.</p>\r\n\r\n<p><br />\r\n<strong>Visitatori</strong>. Tutti i curiosi, i familiari, i ricercatori che usano la piattaforma per curiosit&agrave; o per fare&nbsp;delle ricerche.</p>\r\n\r\n<p><br />\r\nOgni funzione pu&ograve; svolgere quelle di livello inferiore. Il leader viene scelto in base alla vocazione&nbsp;tra lo staff di archivisti dal leader uscente o se deceduto da tutti i membri dello staff.</p>\r\n\r\n<p><br />\r\n<strong>Avere una organizzazione che si autosostenga da un punto di&nbsp;</strong><strong>vista economico per fare fronte alle spese.</strong></p>\r\n\r\n<p>Liveforever deve sostenere dei costi legati al progetto:<br />\r\n&bull; Spese per il mantenimento del server<br />\r\n&bull; Attivit&agrave; del team (sviluppo e mantenimento software, legali, commerciali,...)<br />\r\n&bull; Attrezzature per la memorizzazione dei dati<br />\r\n&bull; Commerciali: acquisto spazi per fare conoscere e promuovere l&rsquo;attivit&agrave;</p>\r\n\r\n<p><br />\r\nAl momento gli investimenti iniziali sono sostenuti dal leader del progetto, l&rsquo;ing.Mauro Pompetti e&nbsp;da attivit&agrave; volontarie da parte di amici che credono nell&rsquo;iniziativa.<br />\r\nIntanto si sta pensando a come creare una autonomia finanziaria al progetto con le seguenti attivit&agrave;:</p>\r\n\r\n<ul>\r\n	<li>Rendere &#39;Liveforever&#39;&nbsp; una fondazione onlus destinataria del 5 per mille</li>\r\n	<li>Portare il progetto su kickstarter e Indiegogo</li>\r\n	<li>Vendere fiori virtuali da attribuire agli utenti per onorarne la memoria</li>\r\n	<li>Vendere baci e carezze virtuali per onorare i vivi</li>\r\n	<li>Vendere stampe di qualit&agrave; albero genealogico</li>\r\n	<li>Vendere video di presentazione di qualit&agrave;</li>\r\n	<li>Organizzazione eventi per incontrare i parenti</li>\r\n	<li>Organizzazione viaggi per incontrare parenti lontani viaggio e pernottamento</li>\r\n	<li>Promozione e trasferimento regali per nuove nascite</li>\r\n	<li>Consegna fiori o opere di beneficienza in onore delle persone&nbsp; decedute</li>\r\n</ul>', '<p>The idea of keeping people&#39;s data for an unlimited duration is complex and has led us to&nbsp;face the following problems:</p>\r\n\r\n<p><br />\r\n1) Choice of compact and durable storage medium<br />\r\n2) As technology changes, transfer the archives to more modern media<br />\r\n3) Store archives in a temperature, humidity and dust controlled location that is safe from vandals.<br />\r\n4) Duplicate the archives and place them in geographically distant places, so as to protect them from catastrophic&nbsp;events<br />\r\n5) Have an organization that updates data and programs in archives that lasts forever.<br />\r\n6) Have an organization that is self-sustaining from an economic point of view to cover the&nbsp;expenses.</p>\r\n\r\n<p><br />\r\nUse compact, durable storage media</p>\r\n\r\n<p><br />\r\nAt the moment it seems Blu-ray technology is the most durable in terms of data retention. A<br />\r\nDirect experience is not possible because these DVDs were developed recently but they provide&nbsp;hypothetical and perhaps optimistic durations of 1000 years.<br />\r\nFor a manufacturer like Milleniata it is easy to insert a duration much longer than it will be<br />\r\nrealistically the life of the company itself, therefore we take statements with a certain caution<br />\r\ntoo optimistic.<br />\r\nWe have decided that from the beginning of the life of the Live forever project, we will start with the archiving of&nbsp;data on Blu-ray discs, with the mission of regenerating the archive every 50 years or sooner depending on the technology&nbsp;will propose more advantageous devices (and so we respond to point 2).<br />\r\nAt the same time, the data is entrusted to the cloud, in particular to Aruba, a leader at this time,&nbsp;(and so we answer point 4).<br />\r\nAdditionally, data is periodically sent to organizations that are assumed to live forever<br />\r\nwith data maintained by churches and state organizations.</p>\r\n\r\n<p>Store archives in a temperature, humidity and dust controlled location</p>\r\n\r\n<p><br />\r\nThe preservation of the first archives, in the form of Blu-ray DVDs, will take place in the original container&nbsp;which protects from dust and in a safe protected by an alarm system.</p>\r\n\r\n<p>The safe is&nbsp;positioned in an inhabited place, the temperature and humidity do not undergo strong variations thanks to the&nbsp;heating and air conditioning systems.</p>\r\n\r\n<p><br />\r\nHave an organization that updates data and programs in archives that lasts forever.</p>\r\n\r\n<p><br />\r\nHaving an organization that updates data and programs in archives that lasts forever is a<br />\r\nquite challenging goal. For an organization to last, some requirements are necessary:<br />\r\n&bull; the presence of a leader who motivates and manages the organization<br />\r\n&bull; a leader replacement system<br />\r\n&bull; a system for selecting and motivating collaborators<br />\r\n&bull; a certain profit</p>\r\n\r\n<p><br />\r\nFrom a functional point of view the organization is divided into:</p>\r\n\r\n<p>Leader. It carries out asset and financial management functions. The archivist staff is present for&nbsp;strategic decisions. He is responsible for data storage.</p>\r\n\r\n<p><br />\r\nArchivist staff. They are those authorized to enter data directly and manage reports<br />\r\nof errors, correct and eliminate disturbing or duplicate profiles, take part in the strategy of<br />\r\nplatform. They are the only ones who can access the back office.</p>\r\n\r\n<p><br />\r\nJunior archivists. They are those who register and then enter data for themselves and others, they are&nbsp;enabled for direct data entry. They help resolve disputes over data entered by them,<br />\r\nenable users.</p>\r\n\r\n<p><br />\r\nUsers. They are those who register and then enter their family and with this complete the<br />\r\ntheir activities on the platform.</p>\r\n\r\n<p><br />\r\nVisitors. All the curious, family members, researchers who use the platform out of curiosity or to do&nbsp;of research.</p>\r\n\r\n<p><br />\r\nEach function can perform lower level ones. The leader is chosen based on vocation<br />\r\namong the archivist staff by the outgoing leader or if deceased by all staff members.</p>\r\n\r\n<p><br />\r\nHave an organization that is self-sustaining from an economic point of view to cover expenses.</p>\r\n\r\n<p>Liveforever must bear costs related to the project:<br />\r\n&bull; Server maintenance costs<br />\r\n&bull; Team activities (software development and maintenance, legal, commercial,...)<br />\r\n&bull; Data storage equipment<br />\r\n&bull; Commercial: purchase of spaces to raise awareness and promote the business<br />\r\nAt the moment the initial investments are supported by the project leader, engineer Mauro Pompetti e&nbsp;from voluntary activities by friends who believe in the initiative.<br />\r\nIn the meantime, we are thinking about how to create financial autonomy for the project with the following activities:</p>\r\n\r\n<ul>\r\n	<li>Make &#39;Liveforever&#39; a non-profit foundation receiving 5 per thousand</li>\r\n	<li>Bring the project to Kickstarter and Indiegogo</li>\r\n	<li>Sell virtual flowers to give to users to honor their memory</li>\r\n	<li>Sell virtual kisses and caresses to honor the living</li>\r\n	<li>Sell quality family tree prints</li>\r\n	<li>Sell quality presentation videos</li>\r\n	<li>Organization of events to meet relatives</li>\r\n	<li>Organization of trips to meet distant relatives, travel and overnight stay</li>\r\n	<li>Promotion and transfer of gifts for new births</li>\r\n	<li>Deliver flowers or charity works in honor of &nbsp;deceased people</li>\r\n</ul>', NULL, '20240315092239-CATA-2020-04-15-Conserva-i-tuoi-documenti-a-norma-d.jpg', 2, 'strategia-di-conservazione-dei-dati', NULL, 1, 0, 0, 1, 1),
(740, '2024-03-02 09:46:01', '2024-03-23 09:54:57', 'Sponsor', 'Sponsor', 'Sponsor', 'Sponsor', '<p><strong>Pagina degli sponsor</strong></p>\r\n\r\n<p><strong>In questa pagina sono presenti individui ed aziende che hanno o stanno contribuendo alla realizzazione del progetto Liveforever.</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>DPM Elettronica srl Foggia Laboratorio Ingegneria</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Bunker degli Inventori srl Foggia Hotel</strong></p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Francesco Protano</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Vuoi unirti a noi e contribuire alla buona riuscita del progetto, invia la tua candidatura tramite il form sottostante.</strong></p>\r\n\r\n<p>&nbsp;</p>', '<h1>Sponsors page.</h1>\r\n\r\n<p><br />\r\n<strong>On this page there are individuals and companies that have or are contributing to the realization of the Liveforever project.</strong></p>\r\n\r\n<ul>\r\n	<li>DPM Elettronica srl Foggia Engineering Laboratory</li>\r\n	<li>Bunker degli Inventori srl Foggia Hotel</li>\r\n	<li>Francesco Protano</li>\r\n</ul>\r\n\r\n<p>If you want to join us and contribute to the success of the project, send your application using the form below.</p>', 'contact-join-as-sponsor', NULL, NULL, 'sponsor', NULL, 1, 0, 0, 1, 1),
(741, '2024-03-02 09:48:39', '2024-04-08 07:16:16', 'Donazioni', 'Donazioni', 'Donazioni', 'Donazioni', '<h1>Donazioni</h1>\r\n\r\n<p>In questa pagina indichiamo le iniziative verso le quali facciamo donazioni in tempo e con il denaro raccolto da voi e da altri donatori.</p>\r\n\r\n<ul>\r\n	<li>Mantenimento del sito Liveforever e dei dati di tutti gli iscritti.</li>\r\n	<li>Aiuti all&#39;associazione Costruisci la tua Idea volta a produrre posti di lavoro in un&#39;area svantaggiata. www.colati.eu</li>\r\n	<li>Aiuti&nbsp; a favore delle iniziative di incremento dei posti di lavoro tramite l&#39;associazione La rete del Dono. www.retedeldono.it</li>\r\n	<li>Aiuti all&#39;associazione Carovana Folkart per la promozione delle cultura popolare tramite concerti,&nbsp;stage e corsi di danza&nbsp;https://www.facebook.com/staffcarovana/</li>\r\n	<li>Aiuti all&#39;associazione Etnos per il recupero delle tradizioni popolari e la valorizzazione delle diverse identit&agrave; culturali</li>\r\n</ul>', '<h1>Donations.</h1>\r\n\r\n<p><strong>On this page we indicate the initiatives to which we donate on time and with the money raised by you and other donors.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Maintenance of the Liveforever website and the data of all members.</strong></li>\r\n	<li><strong>Aid to the Build Your Idea association aimed at producing jobs in a disadvantaged area. www.colati.eu</strong></li>\r\n	<li><strong>Aid for initiatives to increase jobs through the association La rete del Dono. www.retedeldono.it</strong></li>\r\n	<li><strong>Aid to the Carovana Folkart association for the promotion of popular culture through concerts,&nbsp;internships and dance courses&nbsp;https://www.facebook.com/staffcarovana/</strong></li>\r\n	<li><strong>Aid to the Etnos association for the recovery of popular traditions and the valorization of different cultural identities</strong></li>\r\n</ul>', 'donation-form', NULL, NULL, 'donazioni', NULL, 1, 0, 0, 1, 1),
(742, '2024-03-02 15:25:26', '2024-03-02 15:25:26', 'Ti sei candidato come archivista', 'Ti sei candidato come archivista', 'Ti sei candidato come archivista', 'Ti sei candidato come archivista', '<p>Grazie per averci inviato la candidatura. Verrai ricontattato nelle prossime ore</p>', '<p>Grazie per averci inviato la candidatura. Verrai ricontattato nelle prossime ore</p>', 'contact-join-as-archivist-success', NULL, NULL, 'ti-sei-candidato-come-archivista', NULL, 1, 0, 0, 1, 0);
