(743, '2024-03-02 15:27:13', '2024-04-13 17:40:19', 'Ti stai candidando come genealogista', 'Ti stai candidando come genealogista', 'Diventa Genealogista', 'Join as Genealogist', '<h1>Scopri le tue radici! Diventa un genealogista!&nbsp;</h1>\r\n\r\n<p>Sei pronto a fare un viaggio emozionante nel passato per scoprire le tue radici e la storia della tua famiglia? Diventare un genealogista potrebbe essere il tuo passo verso un&#39;avventura affascinante e gratificante. Ecco perch&eacute; dovresti considerare seriamente questa affascinante attivit&agrave;:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Scoperta Personale</strong>: Niente pu&ograve; essere pi&ugrave; gratificante che scoprire le storie dei tuoi antenati. Ogni documento, ogni foto, ogni aneddoto racconta una parte della tua storia familiare, aiutandoti a comprendere meglio te stesso e le tue radici.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Preservazione della Storia</strong>: Come genealogista, hai il potere di preservare la storia della tua famiglia per le generazioni future. Raccogliendo informazioni e documenti preziosi, aiuti a mantenere viva la memoria dei tuoi antenati e delle loro esperienze.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Connessione con il Passato</strong>: Connettersi con il passato pu&ograve; essere incredibilmente gratificante. Scoprire le vite e le sfide affrontate dai tuoi antenati ti permette di entrare in contatto con le tue radici culturali e storiche in modi che non avresti mai immaginato.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Abilit&agrave; di Ricerca</strong>: Diventare un genealogista richiede abilit&agrave; di ricerca e analisi. Questa attivit&agrave; ti offre l&#39;opportunit&agrave; di sviluppare competenze nel navigare attraverso documenti storici, registri di stato civile, archivi online e molto altro ancora.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Connessioni Familiari</strong>: Molti genealogisti scoprono nuovi parenti e ristabiliscono contatti con membri della famiglia che non conoscevano. Questo pu&ograve; portare a connessioni significative e durature con parenti lontani in tutto il mondo.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Contributo alla Comunit&agrave;</strong>: Diventare un genealogista attivo pu&ograve; anche permetterti di contribuire alla tua comunit&agrave; locale. Potresti aiutare altre persone a scoprire le loro radici o partecipare a progetti di ricerca storica che beneficiano l&#39;intera comunit&agrave;.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Avventura Continua</strong>: Il mondo della genealogia &egrave; infinitamente vasto e stimolante. Anche quando hai tracciato le linee principali della tua famiglia, ci saranno sempre nuovi misteri da risolvere e nuovi rami da esplorare.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Non aspettare oltre! Entra nel mondo avvincente della genealogia e inizia il tuo viaggio per scoprire le tue radici. Che tu sia appassionato di storia, un amante della ricerca o semplicemente desideri connetterti con il tuo passato, diventare un genealogista potrebbe essere la tua prossima grande avventura!</p>\r\n\r\n<p>Sono coloro che si registrano in maniera completa mail verificata, telefono verificato, codice fiscale verificato, foto e fanno domanda di contribuire alla piattaforma come genealogisti. Se accettati &nbsp;possono utilizzare la piattaforma Liveforever senza alcuna limitazione.<br />\r\n&nbsp;</p>\r\n\r\n<p>Il lavoro di genealogista pu&ograve; essere fatto a livello dilettantistico o professionale integrando le informazioni con risultati di ricerche genealogiche a favore di famiglie che lo richiedono, in entrambi casi il genealogista deve essere dotato di passione, precisione, integrit&agrave; morale.</p>\r\n\r\n<p>Essere genealogista da la possibilit&agrave; di scolpire sulla pietra per sempre la vita delle persone, la responsabilit&agrave; e l&#39;onore che questa attivit&agrave; offre &egrave; molto alta e non &egrave; per tutti.</p>\r\n\r\n<p><span style=\"font-size:8px;\">Per avere un&nbsp;maggiore punteggio la domanda per diventare genealogista deve essere corredata da una dichiarazione di impegno e buona condotta del datore di lavoro, dal preside della scuola per gli studenti o da lavori in questo settore gi&agrave; svolti che dimostrino esperienza e seriet&agrave;.&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>', '<h1>Discover your roots! Become a genealogist!&nbsp;</h1>\r\n\r\n<p><br />\r\n<strong>Are you ready to take an exciting journey into the past to discover your roots and your family&#39;s history? Becoming a genealogist could be your step towards a fascinating and rewarding adventure. Here&#39;s why you should seriously consider this fascinating activity:</strong></p>\r\n\r\n<ul>\r\n	<li>Personal Discovery: Nothing can be more rewarding than discovering the stories of your ancestors. Every document, every photo, every anecdote tells a part of your family history, helping you to better understand yourself and your roots.</li>\r\n	<li>Preservation of History: As a genealogist, you have the power to preserve your family&#39;s history for future generations. By gathering valuable information and documents, you help keep the memory of your ancestors and their experiences alive.</li>\r\n	<li>Connection with the Past: Connecting with the past can be incredibly rewarding. Uncovering the lives and challenges faced by your ancestors allows you to connect with your cultural and historical roots in ways you never imagined.</li>\r\n	<li>Research Skills: Becoming a genealogist requires research and analytical skills. This activity offers you the opportunity to develop skills in navigating through historical documents, civil status records, online archives, and much more.</li>\r\n	<li>Family Connections: Many genealogists discover new relatives and reconnect with family members they didn&#39;t know. This can lead to meaningful and long-lasting connections with distant relatives around the world.</li>\r\n	<li>Community Contribution: Becoming an active genealogist can also allow you to contribute to your local community. You could help other people discover their roots or participate in historical research projects that benefit the entire community.</li>\r\n	<li>Adventure Continues: The world of genealogy is endlessly vast and challenging. Even when you&#39;ve traced the main lines of your family, there will always be new mysteries to solve and new branches to explore.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Don&#39;t wait any longer! Enter the enthralling world of genealogy and begin your journey to discover your roots. Whether you&#39;re a history buff, a lover of research, or just want to connect with your past, becoming a genealogist could be your next big adventure!</p>\r\n\r\n<p>They are those who fully register with verified email, verified phone, verified tax code, photo and apply to contribute to the platform as genealogists.</p>\r\n\r\n<p>If accepted, they can use the Liveforever platform without any limitations.</p>\r\n\r\n<p>The work of a genealogist can be done at an amateur or professional level by integrating the information with the results of genealogical research in favor of families who require it, in both cases the genealogist must be endowed with passion, precision, moral integrity.</p>\r\n\r\n<p>Being a genealogist gives you the opportunity to set people&#39;s lives in stone forever, the responsibility and honor that this activity offers is very high and is not for everyone.</p>\r\n\r\n<p>To have a higher score, the application to become a genealogist must be accompanied by a declaration of commitment and good conduct from the employer, the principal of the school for students or work in this field already carried out that demonstrates experience and seriousness.&nbsp;&nbsp;&nbsp;&nbsp;</p>', NULL, '20240323101758-el-genealogista-1-1024x634.jpg', NULL, 'ti-stai-candidando-come-genealogista', NULL, 1, 0, 0, 1, 1),
(744, '2024-03-02 15:59:15', '2024-03-23 09:52:26', 'Grazie per aver inviato la tua candidatura come sponsor', 'Grazie per aver inviato la tua candidatura come sponsor', 'Grazie per aver inviato la tua candidatura come sponsor', 'Grazie per aver inviato la tua candidatura come sponsor', '<p>Grazie per aver inviato la tua candidatura come sponsor. Verrai contattato al pi&ugrave; presto per valutare insieme questa opportunit&agrave;.</p>', '<p>Thank you for submitting your application as a sponsor. You will be contacted as soon as possible to evaluate this opportunity together.</p>', 'contact-join-as-sponsor-success', NULL, NULL, 'grazie-per-aver-inviato-la-tua-candidatura-come-sponsor', NULL, 1, 0, 0, 1, 0),
(745, '2024-03-02 16:08:01', '2024-03-15 09:26:45', 'Vivere a lungo sulla terra', 'Long life', 'Vivere a lungo', 'Long life', '<header data-event-boundary=\"click\" data-event-click=\"{\" pattern=\"\">\r\n<header data-event-boundary=\"click\" data-event-click=\"{\" pattern=\"\">\r\n<p>Power 9, i 9 principi seguiti dalle persone pi&ugrave; longeve al mondo</p>\r\n\r\n<p>Ecco come strutturare le tue giornate per prepararti a una vita lunga e sana attenendoti ai precetti dei Power 9 di&nbsp;Emily Abbate</p>\r\n\r\n<p>Tradotto e adattato da&nbsp;Tommaso Lavizzari&nbsp;&nbsp;&nbsp;&nbsp;28 febbraio 2024 Getty Images; Gabe Conte</p>\r\n\r\n<p>I Power 9 non sono il solito elenco di cose giuste da fare&nbsp;per vivere pi&ugrave; a lungo. Quante volte ti hanno detto di bere&nbsp;otto bicchieri d&#39;acqua al giorno&nbsp;oppure ti hanno raccomandato di&nbsp;assumere i giusti integratori? Altri ancora tentano costantemente di affidarti il compito impossibile, ma promettente, di&nbsp;mantenere una mentalit&agrave; positiva.</p>\r\n\r\n<p>Oggi l&#39;aspettativa di vita media&nbsp;&egrave; cresciuta molto. Secondo uno studio,&nbsp;nel 2023 pi&ugrave; di 70.000 americani&nbsp;hanno compiuto 100 anni. Nelle&nbsp;Blue Zone, ovvero le regioni del mondo in cui le persone vivono eccezionalmente a lungo, per&ograve;,&nbsp;le probabilit&agrave; di arrivare&nbsp;a 100 anni sono dieci volte maggiori. Questi luoghi, in particolare tra la regione della Barbagia e l&#39;Ogliastra in Sardegna, Okinawa in Giappone, la penisola di Nicoya in Costa Rica e Icaria in Grecia, sono pieni di centenari.</p>\r\n\r\n<p>Era solo questione di tempo prima che ricercatori medici, demografi, epidemiologi e antropologi scavassero a fondo per scoprire i denominatori comuni tra questi luoghi. &Egrave; cos&igrave; che sono emerse i Power 9 delle Blue Zone, ovvero nove cose che i cinque luoghi con la pi&ugrave; alta percentuale di persone che raggiungono i 100 anni di et&agrave; hanno in comune.&nbsp;Dan Buettner&nbsp;del&nbsp;National Geographic&nbsp;ha pubblicato questi risultati nel suo libro&nbsp;The Blue Zones: Lessons for Living Longer From the People Who&#39;ve Lived the Longest. Abbiamo chiesto ai nostri esperti di longevit&agrave; di esprimersi su ciascuno dei nove pilastri.</p>\r\n\r\n<p>1. Muoversi in modo naturale</p>\r\n\r\n<p><img src=\"https://tse4.mm.bing.net/th?id=OIP.mtFsbiNvkQgFcbBeb4JQEgHaE8&amp;pid=Api&amp;P=0&amp;h=180\" /></p>\r\n\r\n<p>Gli studi dimostrano&nbsp;che un comportamento sedentario, come stare seduti per 13 ore o camminare meno di 4.000 passi al giorno, pu&ograve; ridurre i benefici metabolici dell&#39;esercizio fisico acuto, mentre un&#39;attivit&agrave; occasionale&nbsp;potrebbe aiutare a ridurre i livelli di insulina dopo i pasti.&nbsp;I ricercatori&nbsp;hanno persino scoperto che le &quot;flessioni del soleo&quot; (che per la maggior parte di noi sono sollevamenti dei polpacci) eseguite in posizione seduta sono in grado di attivare il metabolismo per ore. In altre parole: non &egrave; necessario dedicare 90 minuti al giorno all&#39;esercizio fisico. &Egrave; dimostrato che fare esercizi durante la giornata, o incorporare piccoli movimenti nel corso del giorno, sia efficace quanto gli allenamenti pi&ugrave; ampi e pianificati, oltre a essere una routine molto pi&ugrave; accessibile per la maggior parte delle persone.</p>\r\n\r\n<p>Quindi, da dove si comincia?&nbsp;Il dottor Kien Vuu, fondatore di&nbsp;Vuu MD Performance and Longevity&nbsp;e autore di&nbsp;Thrive State, dice che si inizia pensando alla propria giornata lavorativa in modo diverso. Hai una bicicletta? Opta per&nbsp;camminare&nbsp;o andare in bicicletta almeno per percorrere brevi distanze, oppure per raggiungere l&#39;ufficio, se questa &egrave; un&#39;opzione percorribile. Una volta alla scrivania, prova a sollevare le gambe o a fare stretching da seduto, usa le scale per andare a prendere il caff&egrave; o opta per riunioni in piedi se stai chiacchierando con qualcuno in ufficio. Bastano pochi minuti di attivit&agrave; per interrompere la sedentariet&agrave; e ottenere molti benefici.</p>\r\n\r\n<p>2. Dire di s&igrave; all&#39;happy hour</p>\r\n\r\n<p><img src=\"https://i.pinimg.com/736x/fe/aa/a6/feaaa610fe22fc44b5714abfc9b6cf59.jpg\" style=\"width: 320px; height: 320px;\" />Ormai quasi tutti preferiscono le bevande analcoliche, che siano o meno nel Team Dry January/Sober October.</p>\r\n\r\n<p>Anche se ci sono molte ricerche che elogiano i benefici dell&#39;abbandono totale dell&#39;alcol,&nbsp;un bicchiere di vino &egrave; apprezzato anche nelle Zone Blu.</p>\r\n\r\n<p>Non tanto per i benefici del&nbsp;vino&nbsp;in s&eacute;, quanto per la socializzazione che offre il bere saltuariamente. &laquo;Nelle culture pi&ugrave; longeve, il consumo moderato di alcolici avviene spesso in un contesto sociale, enfatizzando il ruolo della comunit&agrave; e della celebrazione&raquo;, spiega il dottor Vuu. &laquo;La chiave risiede pi&ugrave; nelle interazioni sociali positive che nell&#39;alcol in s&eacute;. Le relazioni positive contribuiscono al benessere mentale ed emotivo&raquo;.</p>\r\n\r\n<p><br />\r\n3. Prendi il tempo per respirare</p>\r\n\r\n<p><img src=\"https://tse1.mm.bing.net/th?id=OIP.i0owxrHc6Qoed9zGSjDqsgHaEm&amp;pid=Api&amp;P=0&amp;h=180\" /></p>\r\n\r\n<p>Lo sappiamo tutti: lo&nbsp;stress&nbsp;non ci fa bene. Tuttavia, spesso &egrave; inevitabile.&nbsp;&laquo;Quando noti che il tuo corpo si tende o che le tue emozioni aumentano, fai un respiro profondo, trattienilo per qualche secondo ed espira lentamente dal naso&raquo;, dice la&nbsp;dottoressa Michelle Loy, specialista in medicina integrativa presso il&nbsp;NewYork-Presbyterian/Weill Cornell Medical Center&nbsp;e assistente di pediatria in medicina clinica presso la&nbsp;Weill Cornell Medicine. &laquo;Pi&ugrave; si pratica questa&nbsp;respirazione, pi&ugrave; fa bene. Si pu&ograve; fare ovunque, in qualsiasi momento, e non interagisce con farmaci o integratori&raquo;.</p>\r\n\r\n<p>Non sai quando cominciare? Inizia prima di andare a letto, ritagliandoti un paio di minuti in pi&ugrave; prima di addormentarti per esercitarti. In seguito, inseriscila in altri momenti della tua giornata.</p>\r\n\r\n<p>4. Dai alla dieta un taglio vegetale</p>\r\n\r\n<p><img src=\"https://thinkhealth.priorityhealth.com/wp-content/uploads/2020/10/ThinkHealth-personal-wellness-vegetarian-scaled.jpg\" style=\"float: left; width: 256px; height: 159px;\" />Rich Roll. Chris Paul. Justin Fields. Kevin Hart. Conosciamo molti soggetti che si attengono a una&nbsp;dieta prevalentemente vegetale&nbsp;e che ne traggono benefici.</p>\r\n\r\n<p>I ricercatori, confermano che nelle Zone Blu prediligono le fonti proteiche vegetali, come i fagioli, compresi quelli neri, la soia, la fava e le lenticchie, alla carne.</p>\r\n\r\n<p>Quando si ha voglia di soddisfare la propria parte carnivora, si pu&ograve; optare per una porzione di maiale da 3 a 4 etti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Trova il tuo gruppo</p>\r\n\r\n<p><img src=\"https://thumbs.dreamstime.com/z/gruppo-di-amici-sorridenti-che-si-trovano-sull-erba-all-aperto-50426092.jpg\" style=\"width: 320px; height: 220px;\" /></p>\r\n\r\n<p>Se c&#39;&egrave; una cosa che molti hanno imparato negli ultimi anni, quando la socialit&agrave; &egrave; stata tolta dalla nostra quotidianit&agrave;, &egrave; che&nbsp;i legami e l&#39;amicizia hanno un&#39;importanza fondamentale. Quelli che vivono pi&ugrave; a lungo identificano gli amici pi&ugrave; stretti e si impegnano a mantenere queste&nbsp;relazioni&nbsp;per tutta la vita. &Egrave; stato dimostrato che l&#39;amore e le interazioni sociali positive rilasciano ossitocina, nota come &laquo;ormone dell&#39;amore, che svolge un ruolo nel creare legami e ridurre i livelli di stress&raquo;, spiega Vuu. &laquo;Perci&ograve;, relazioni affettuose e di supporto possono portare a miglioramenti a lungo termine dello stato emotivo e della salute fisica&raquo;.</p>\r\n\r\n<p>6. Rispettare la regola dell&#39;80%</p>\r\n\r\n<p><img src=\"https://tse1.mm.bing.net/th?id=OIP.WuO6ZIOVPF4uf3UFYYLqXQHaE8&amp;pid=Api&amp;P=0&amp;h=180\" />I ricercatori hanno scoperto che le persone nelle Zone Blu consumano il pasto pi&ugrave; piccolo nel tardo pomeriggio o nella prima serata e poi non mangiano pi&ugrave; per il resto della giornata. Questo rientra nella cosiddetta &quot;regola dell&#39;80%&quot;, che consiglia di&nbsp;smettere di mangiare&nbsp;quando lo stomaco &egrave; pieno all&#39;80%. Se non siete bravi ad esercitare questo tipo di moderazione. La dottoressa Loy ha un consiglio: &laquo;Quando inizi a sentirti sazio, metti una parte del pasto in un Tupperware - o chiedi che te lo portino via&raquo;.</p>\r\n\r\n<p>7. Mettere i propri cari al primo posto</p>\r\n\r\n<p><img src=\"https://www.spazio50.org/wp-content/uploads/2021/11/Limpegno-di-cura-dei-cari.jpg\" style=\"width: 200px; height: 133px;\" />Investire tempo nella famiglia &egrave; un&#39;attivit&agrave; che ripaga non solo dal punto di vista emotivo, ma anche in termini di longevit&agrave;. I centenari di successo tengono vicini i genitori (o i nonni) anziani, si impegnano con un compagno di vita e, se hanno figli, si sforzano di passare pi&ugrave; tempo possibile con loro.</p>\r\n\r\n<p>8. Trovare un luogo di appartenenza</p>\r\n\r\n<p><img src=\"https://media.licdn.com/dms/image/D4E12AQFDGoOu0YSYoA/article-cover_image-shrink_720_1280/0/1654157436257?e=2147483647&amp;v=beta&amp;t=SNNrdjO0wsLt89p-0HssEkfWOFGs4IdfPl5q2_Y4iCo\" style=\"width: 200px; height: 150px;\" />Le ricerche dimostrano che&nbsp;frequentare un luogo di culto quattro volte al mese&nbsp;potrebbe aggiungere da 4 a 14 anni alla vostra aspettativa di vita. Se la religione non &egrave; nelle vostre corde, c&#39;&egrave; sempre l&#39;opportunit&agrave; di immergersi in profondit&agrave; nel proprio benessere personale. Cerca un luogo che ti faccia sentire accettato e considerato, che sia la palestra di CrossFit o un rituale settimanale al ristorante sotto casa.</p>\r\n\r\n<p>9. Conoscere il proprio &quot;perch&eacute;&quot;</p>\r\n\r\n<p><img src=\"https://tse2.explicit.bing.net/th?id=OIP.0Wh32wPiqH_9cFk6DntDJAHaFj&amp;pid=Api&amp;P=0&amp;h=180\" />Quando si sa perch&eacute; ci si sveglia la mattina e si ha uno scopo nella vita di tutti i giorni, le ricerche dimostrano che si possono aggiungere fino a sette anni alla propria aspettativa di vita. Il concetto giapponese di Ikigai incoraggia gli individui a trovare la propria vocazione o il proprio scopo personale, aggiunge il dottor Loy, che consiglia di porsi quattro domande e di trovare il punto di intersezione tra queste risposte:</p>\r\n\r\n<ol>\r\n	<li>Cosa amo? (Passione)</li>\r\n	<li>In che cosa sono bravo? (Professione)</li>\r\n	<li>Di cosa ha bisogno il mondo? (Missione)</li>\r\n	<li>Per cosa posso essere ricompensato? (Vocazione)</li>\r\n</ol>\r\n\r\n<p>&laquo;Pu&ograve; essere necessario un po&#39; di esame di coscienza, ma vale la pena dedicare del tempo a questa ricerca personale, perch&eacute; quando si trova il proprio Ikigai, o pi&ugrave; di uno, si fa chiarezza sul modo in cui si vive la propria vita,&raquo; afferma l&#39;autrice.</p>\r\n\r\n<ul>\r\n	<li>Articolo originariamente pubblicato su&nbsp;GQ US</li>\r\n	<li>Cosa insegna&nbsp;Zone Blu - i segreti della longevit&agrave;&nbsp;su come arrivare a 100 anni ancora pieni di vigore (di&nbsp;Eugenio Spagnuolo)</li>\r\n	<li>Cosa succede al nostro corpo quando non assumiamo abbastanza vitamina D (di&nbsp;Natalie Arroyo Camacho)</li>\r\n	<li>8 tipi di amici di cui hai bisogno, secondo la scienza, per vivere felice (di&nbsp;Paloma Gonz&aacute;lez)</li>\r\n	<li>I cibi pi&ugrave; ricchi di fibre e come inserirli nella dieta (di&nbsp;Olga Noel Winderling)<br />\r\n	&nbsp;</li>\r\n</ul>\r\n</header>\r\n</header>', '<p>&nbsp;</p>\r\n\r\n<p>Power 9, the 9 principles followed by the longest-lived people in the world Here&#39;s how to structure your days to prepare for a long and healthy life by following the precepts of the Power 9 by&nbsp;Emily Abbate Translated and adapted by&nbsp;Tommaso Lavizzari&nbsp; &nbsp; February 28, 2024 Getty Images; Gabe Conte</p>\r\n\r\n<p>The Power 9 are not your typical list of right things to do&nbsp;to live longer.</p>\r\n\r\n<p>How many times have you been told to drink&nbsp;eight glasses of water a day&nbsp;or recommended that you&nbsp;take the right supplements?</p>\r\n\r\n<p>Still others constantly try to give you the impossible, yet promising task of&nbsp;maintaining a positive mindset. Today the average life expectancy&nbsp;has grown a lot. According to one study,&nbsp;in 2023, more than 70,000 Americans&nbsp;turned 100 years old.</p>\r\n\r\n<p>In the&nbsp;Blue Zones, i.e. the regions of the world where people live exceptionally long, however,&nbsp;the chances of reaching&nbsp;100 years are ten times greater.</p>\r\n\r\n<p>These places, particularly between the Barbagia region and Ogliastra in Sardinia, Okinawa in Japan, the Nicoya Peninsula in Costa Rica and Icaria in Greece, are full of centenarians. It was only a matter of time before medical researchers, demographers, epidemiologists and anthropologists dug deep to uncover the common denominators between these places.</p>\r\n\r\n<p>That&#39;s how the Power 9 of the Blue Zones emerged, or nine things that the five places with the highest percentage of people reaching 100 years of age have in common.</p>\r\n\r\n<p>Dan Buettner&nbsp;of&nbsp;National Geographic&nbsp;published these findings in his book&nbsp;The Blue Zones: Lessons for Living Longer From the People Who&#39;ve Lived the Longest.</p>\r\n\r\n<p>We asked our longevity experts to weigh in on each of the nine pillars.</p>\r\n\r\n<p>1. Move naturally</p>\r\n\r\n<p><img src=\"https://tse4.mm.bing.net/th?id=OIP.mtFsbiNvkQgFcbBeb4JQEgHaE8&amp;pid=Api&amp;P=0&amp;h=180\" />Studies show&nbsp;that sedentary behavior, such as sitting for 13 hours or walking fewer than 4,000 steps per day, can reduce the metabolic benefits of acute exercise, while occasional activity&nbsp;could help reduce insulin levels after meals . Researchers&nbsp;have even found that &ldquo;soleus push-ups&rdquo; (which for most of us are calf raises) performed in a seated position can activate your metabolism for hours.</p>\r\n\r\n<p>In other words: you don&#39;t need to dedicate 90 minutes a day to exercise. Doing exercise throughout the day, or incorporating small movements throughout the day, is proven to be just as effective as larger, planned workouts, as well as being a much more accessible routine for most people.</p>\r\n\r\n<p>So, where do we start? Dr Kien Vuu, founder of&nbsp;Vuu MD Performance and Longevity&nbsp;and author of&nbsp;Thrive State, says you start by thinking about your workday differently. Do you have a bicycle? Opt to&nbsp;walk&nbsp;or cycle at least to travel short distances, or to get to the office if that is a viable option. Once at the desk, he tries leg lifts or stretching while sitting, uses the stairs to get coffee or opts for standing meetings if you&#39;re chatting with someone in the office. A few minutes of activity are enough to stop a sedentary lifestyle and obtain many benefits.</p>\r\n\r\n<p>2. Say yes to happy hour</p>\r\n\r\n<p><img src=\"https://i.pinimg.com/736x/fe/aa/a6/feaaa610fe22fc44b5714abfc9b6cf59.jpg\" /> Nowadays, almost everyone prefers soft drinks, whether they&#39;re on Team Dry January/Sober October or not. Although there is a lot of research praising the benefits of completely abandoning alcohol,&nbsp;a glass of wine is also appreciated in the Blue Zones. Not so much for the benefits of the&nbsp;wine&nbsp;in itself, but for the socialization that drinking occasionally offers. &ldquo;In longer-lived cultures, moderate alcohol consumption often occurs in a social context, emphasizing the role of community and celebration,&rdquo; explains Dr. Vuu. &laquo;The key lies more in positive social interactions than in alcohol itself. Positive relationships contribute to mental and emotional well-being.&quot;</p>\r\n\r\n<p>3. Take time to breathe</p>\r\n\r\n<p><img src=\"https://tse1.mm.bing.net/th?id=OIP.i0owxrHc6Qoed9zGSjDqsgHaEm&amp;pid=Api&amp;P=0&amp;h=180\" />We all know it:&nbsp;stress&nbsp;isn&#39;t good for us. However, it is often unavoidable. &ldquo;When you notice your body tensing or your emotions rising, take a deep breath, hold it for a few seconds, and slowly exhale through your nose,&rdquo; says&nbsp;Dr. Michelle Loy, an integrative medicine specialist at&nbsp;NewYork-Presbyterian/Weill Cornell Medical Center&nbsp;and Assistant Professor of Pediatrics in Clinical Medicine at&nbsp;Weill Cornell Medicine. &laquo;The more you practice this&nbsp;breathing, the more good it is. It can be done anywhere, at any time, and does not interact with drugs or supplements.&quot; Don&#39;t know when to start? Start before bed, carving out a couple of extra minutes before falling asleep to practice. Then, incorporate it into other parts of your day.</p>\r\n\r\n<p>4. Give your diet a plant-based twist</p>\r\n\r\n<p><img src=\"https://thinkhealth.priorityhealth.com/wp-content/uploads/2020/10/ThinkHealth-personal-wellness-vegetarian-scaled.jpg\" style=\"float: left; width: 256px; height: 159px;\" />Rich Roll. Chris Paul. Justin Fields. Kevin Hart. We know many people who stick to a&nbsp;predominantly plant-based diet&nbsp;and who benefit from it.</p>\r\n\r\n<p>The researchers confirm that in the Blue Zones they prefer vegetable protein sources, such as beans, including black ones, soy, broad bean and lentils, over meat.</p>\r\n\r\n<p>When you want to satisfy your carnivorous side, you can opt for a 3 to 4 ounce portion of pork.</p>\r\n\r\n<p>5. Find your group</p>\r\n\r\n<p><img src=\"https://thumbs.dreamstime.com/z/gruppo-di-amici-sorridenti-che-si-trovano-sull-erba-all-aperto-50426092.jpg\" style=\"width: 320px; height: 220px;\" />If there is one thing that many have learned in recent years, when sociality has been removed from our daily lives, it is that&nbsp;bonds and friendships are of fundamental importance. Those who live the longest identify close friends and commit to maintaining these&nbsp;relationships&nbsp;throughout their lives. Love and positive social interactions have been shown to release oxytocin, known as the &ldquo;love hormone, which plays a role in bonding and reducing stress levels,&rdquo; explains Vuu. &ldquo;Therefore, warm and supportive relationships can lead to long-term improvements in emotional state and physical health.&rdquo;</p>\r\n\r\n<p>6. Stick to the 80% rule</p>\r\n\r\n<p><img src=\"https://tse1.mm.bing.net/th?id=OIP.WuO6ZIOVPF4uf3UFYYLqXQHaE8&amp;pid=Api&amp;P=0&amp;h=180\" />The researchers found that people in Blue Zones eat their smallest meal in the late afternoon or early evening and then don&#39;t eat again for the rest of the day. This falls under the so-called &ldquo;80% rule,&rdquo; which recommends that you&nbsp;stop eating&nbsp;when your stomach is 80% full. If you are not good at exercising this type of moderation. Dr. Loy has a tip: &quot;When you start to feel full, put part of the meal in a Tupperware - or ask for it to be taken away.&quot;</p>\r\n\r\n<p>7. Put your loved ones first</p>\r\n\r\n<p><img src=\"https://www.spazio50.org/wp-content/uploads/2021/11/Limpegno-di-cura-dei-cari.jpg\" style=\"width: 200px; height: 133px;\" />Investing time in your family is an activity that pays off not only emotionally, but also in terms of longevity. Successful centenarians keep their aging parents (or grandparents) close, are committed to a life partner, and, if they have children, make an effort to spend as much time with them as possible.</p>\r\n\r\n<p>8. Find a place of belonging</p>\r\n\r\n<p><img src=\"https://media.licdn.com/dms/image/D4E12AQFDGoOu0YSYoA/article-cover_image-shrink_720_1280/0/1654157436257?e=2147483647&amp;v=beta&amp;t=SNNrdjO0wsLt89p-0HssEkfWOFGs4IdfPl5q2_Y4iCo\" style=\"width: 200px; height: 150px;\" />Research shows that&nbsp;attending a place of worship four times a month&nbsp;could add 4 to 14 years to your life expectancy. If religion isn&#39;t your thing, there&#39;s always the opportunity to dive deep into your personal well-being. Look for a place that makes you feel accepted and considered, whether it&#39;s the CrossFit gym or a weekly ritual at the local restaurant.</p>\r\n\r\n<p>9. Know your &quot;why&quot;</p>\r\n\r\n<p><img src=\"https://tse2.explicit.bing.net/th?id=OIP.0Wh32wPiqH_9cFk6DntDJAHaFj&amp;pid=Api&amp;P=0&amp;h=180\" />When you know why you wake up in the morning and have a purpose in your everyday life, research shows you can add up to seven years to your life expectancy. The Japanese concept of Ikigai encourages individuals to find their personal calling or purpose, adds Dr. Loy, who recommends asking yourself four questions and finding the intersection between these answers:</p>\r\n\r\n<ol>\r\n	<li>What do I love? (Passion)</li>\r\n	<li>What am I good at? (Profession)</li>\r\n	<li>What does the world need? (Mission)</li>\r\n	<li>What can I be compensated for? (Vocation)</li>\r\n</ol>\r\n\r\n<p>&laquo;It may require some soul-searching, but it is worth taking the time to do this personal search, because when you find your Ikigai, or more than one, you gain clarity on the way you live your life, &raquo; states the author.</p>\r\n\r\n<ul>\r\n	<li>Article originally published in&nbsp;GQ US What&nbsp;Blue Zones teaches - the secrets of longevity&nbsp;on how to reach 100 years still full of vigor (by&nbsp;Eugenio Spagnuolo)</li>\r\n	<li>What happens to our body when we don&#39;t get enough vitamin D (by&nbsp;Natalie Arroyo Camacho)</li>\r\n	<li>8 types of friends you need, according to science, to live happily (by&nbsp;Paloma Gonz&aacute;lez)</li>\r\n	<li>The foods richest in fiber and how to include them in your diet (by&nbsp;Olga Noel Winderling)</li>\r\n</ul>', NULL, '20240315092639-vfa9wz3l.png', 2, 'viverealungo', 2, 1, 0, 0, 1, 1),
(747, '2024-03-15 09:08:02', '2024-03-15 10:29:07', 'Intervista da lasciare ai posteri', 'Interview for future generations', 'Intervista', 'Interview', '<p><strong>Contenuti</strong></p>\r\n\r\n<p>Prima di fare l&#39;intervista leggete tutte le domande previste cos&igrave; vi potete farvi&nbsp;una idea prima e essere pi&ugrave; spediti durante il video. Se ci sono delle risposte che non volete dare eliminatele dalla lista di domande prima dell&#39;intervista.&nbsp;</p>\r\n\r\n<p><strong>Intervistatore</strong></p>\r\n\r\n<p>Ora scegliete una persona con cui siete in confidenza e chiedetegli se &egrave; disponibile a farvi l&#39;intervista. Ditegli che questa deve durare dai 3 ai 4 minuti quindi di fare segnali quando le risposte si allungano un po troppo. Se le riprese vengono fatte con un cellulare fate attenzione a non stare troppo lontani, massimo 1.5 metri</p>\r\n\r\n<p><strong>Aspetto</strong></p>\r\n\r\n<p>Per quanto riguarda il vostro aspetto dipende da voi. Se volete lasciare una immagine di voi pi&ugrave; naturale possibile non dovete fare nulla, se volete lasciare una immagine pi&ugrave; curata sapete certamente voi come fare.</p>\r\n\r\n<p><strong>Luogo</strong></p>\r\n\r\n<p>Il luogo dell&#39;intervista non &egrave; da sottovalutare. I requisiti essenziali sono la luce e l&#39;assenza di rumori molesti. La presenza di posti a sedere pu&ograve; rendere tutto pi&ugrave; confortevole. Infine fare il video in un ambiente molto familiare all&#39;intervistato lascia ulteriori informazioni ai posteri.</p>\r\n\r\n<p><strong>Le domande</strong></p>\r\n\r\n<p>1) Come ti chiami?</p>\r\n\r\n<p>2) Dove ti trovi e che giorno &egrave; oggi ? (giorno, mese, anno)</p>\r\n\r\n<p>3) Come si chiamano i tuoi genitori e come sei stato con loro?</p>\r\n\r\n<p>4) Come si chiamano i tuoi figli e l&#39;affetto che provi per loro?</p>\r\n\r\n<p>5) Quali sono le tue passioni ed i tuoi sogni?</p>\r\n\r\n<p>6) Qual&#39;&egrave; stato l&#39;evento pi&ugrave; brutto della tua vita?</p>\r\n\r\n<p>7) Qual&#39;&egrave; stato l&#39;evento pi&ugrave; bello della tua vita?</p>\r\n\r\n<p>8) Cosa prevedi accadr&agrave; nel futuro del pianeta?</p>\r\n\r\n<p>9) Che messaggio/consiglio vuoi lasciare a chi vedr&agrave; questo video?</p>\r\n\r\n<p>Poi se volete far lasciare un messaggio pi&ugrave; profondo e caratterizzante, fate riflettere e poi sottoponete le seguenti domande:</p>\r\n\r\n<p dir=\"ltr\">10) Cosa ami? (Passione)</p>\r\n\r\n<p dir=\"ltr\">11) In che cosa sei bravo? (Professione)</p>\r\n\r\n<p dir=\"ltr\">12) Di cosa ha bisogno il mondo che tu puoi dare? (Missione)</p>\r\n\r\n<p dir=\"ltr\">13) Per cosa puoi&nbsp;essere ricompensato? (Vocazione)</p>', '<p>Contents</p>\r\n\r\n<p>Before doing the interview, read all the questions provided so you can get an idea beforehand and be more fluent during the video. If there are any answers you don&#39;t want to give, remove them from the list of questions before the interview.</p>\r\n\r\n<p>Interviewer</p>\r\n\r\n<p>Now choose a person with whom you are close and ask him if he is available to do the interview with you. Tell him that this should last 3 to 4 minutes so to signal when the answers get a little too long. If the shots are taken with a mobile phone, be careful not to stay too far away, maximum 1.5 metres</p>\r\n\r\n<p>I wait</p>\r\n\r\n<p>As for your appearance, it&#39;s up to you. If you want to leave the most natural image of yourself possible you don&#39;t have to do anything, if you want to leave a more refined image you certainly know how to do it.</p>\r\n\r\n<p>Place</p>\r\n\r\n<p>The location of the interview is not to be underestimated. The essential requirements are light and the absence of disturbing noises. The presence of seating can make everything more comfortable. Finally, making the video in an environment very familiar to the interviewee leaves further information for posterity.</p>\r\n\r\n<p>The questions</p>\r\n\r\n<p>1) What is your name?</p>\r\n\r\n<p>2) Where are you and what day is it today? (day, month, year)</p>\r\n\r\n<p>3) What are your parents&#39; names and how did you stay with them?</p>\r\n\r\n<p>4) What are your children&#39;s names and the affection you feel for them?</p>\r\n\r\n<p>5) What are your passions and dreams?</p>\r\n\r\n<p>6) What was the worst event in your life?</p>\r\n\r\n<p>7) What was the best event of your life?</p>\r\n\r\n<p>8) What do you predict will happen in the future of the planet?</p>\r\n\r\n<p>9) What message/advice do you want to leave to those who see this video?</p>\r\n\r\n<p>Then if you want to leave a deeper and more distinctive message, make people reflect and then ask the following questions:</p>\r\n\r\n<p>10) What do you love? (Passion)</p>\r\n\r\n<p>11) What are you good at? (Profession)</p>\r\n\r\n<p>12) What does the world need that you can give? (Mission)</p>\r\n\r\n<p>13) What can you&nbsp;be rewarded for? (Vocation)</p>', NULL, '20240315090738-interview-190927.jpg', 2, 'intervista-da-lasciare-ai-posteri', 2, 1, 0, 0, 1, 1),
(748, '2024-03-23 09:22:21', '2024-03-23 09:22:21', 'Lascia il tuo segno digitale nel mondo!', 'Leave your sign in the world', 'Lascia un segno', 'Leave a sign', '<h1><strong>&nbsp;Lascia il tuo segno digitale nel mondo!&nbsp;</strong></h1>\r\n\r\n<p>Caro amico, sei pronto a fare una differenza nel vasto oceano di internet? Sei pronto a lasciare il tuo segno, una traccia luminosa che continuer&agrave; a brillare attraverso il passare del tempo? Bene, &egrave; ora di prendere in considerazione l&#39;opportunit&agrave; di lasciare la tua impronta su una piattaforma web.</p>\r\n\r\n<p>Il mondo online &egrave; come un grande libro aperto, in costante evoluzione e pieno di storie da condividere. E tu hai una storia da raccontare, una visione da esprimere, un talento da mostrare al mondo! Che sia attraverso un blog, una pagina di social media, un portfolio artistico o qualsiasi altra forma di espressione online, lasciare una traccia di te su una piattaforma web pu&ograve; portare vantaggi incredibili.</p>\r\n\r\n<p>Immagina di poter ispirare qualcuno dall&#39;altra parte del mondo con le tue parole, di far sorridere qualcuno con la tua arte, di aiutare qualcuno con le tue conoscenze. Il potere di internet &egrave; incredibile, e ogni singola voce conta. Non importa quanto piccola o grande tu possa pensare che sia la tua contribuzione, c&#39;&egrave; sempre qualcuno l&agrave; fuori che potrebbe essere toccato dalla tua presenza online.</p>\r\n\r\n<p>Inoltre, lasciare una traccia di te online pu&ograve; essere un modo straordinario per costruire connessioni significative con persone che condividono i tuoi interessi e le tue passioni. Potresti trovare un pubblico che ti sostiene, collaboratori con cui creare, mentori che ti guidano e amici che condividono il tuo viaggio. Le possibilit&agrave; sono infinite quando decidi di aprirti al mondo attraverso una piattaforma web.</p>\r\n\r\n<p>Ricorda, lasciare una traccia di te online non riguarda solo l&#39;ego o la fama. Si tratta di condividere il tuo unico punto di vista, le tue esperienze e le tue abilit&agrave; per arricchire la comunit&agrave; online e il mondo nel suo complesso. Quindi, non aspettare oltre! Prendi coraggio, trova la tua voce e inizia a lasciare il tuo segno nel vasto universo digitale.</p>\r\n\r\n<p>Il mondo attende di sentire ci&ograve; che hai da dire, di vedere ci&ograve; che hai da mostrare e di essere arricchito dalla tua presenza online. Non perdere questa opportunit&agrave; di fare la differenza. Sii audace, sii autentico, e lascia la tua traccia luminosa nel tessuto stesso del web.&nbsp;<button></button></p>', NULL, NULL, '20240323092103-logo.jpg', 2, '-lascia-il-tuo-segno-digitale-nel-mondo!-', 2, 1, 0, 0, 1, 1),
(749, '2024-04-08 06:27:18', '2024-04-08 07:18:50', 'Abbiamo ricevuto la tua donazione', 'Abbiamo ricevuto la tua donazione', 'Abbiamo ricevuto la tua donazione', 'Abbiamo ricevuto la tua donazione', '<p>Grazie per averci supportato</p>', '<p>Thank you for your support</p>', 'donation-success', NULL, NULL, 'abbiamo-ricevuto-la-tua-donazione', NULL, 1, 0, 0, 1, 1),
