INSERT INTO `mail` (`id`, `created_at`, `updated_at`, `code`, `subject`, `body`, `help`, `method_to_call_for_test`) VALUES
(1, '2023-11-05 09:53:49', '2024-01-11 17:22:16', 'to_user_after_register', 'Ti sei registrato su LiveForever', '<p>Ciao<strong>&nbsp;{!! $model-&gt;model-&gt;nameAndSurname !!}</strong></p>\r\n\r\n<p>Prima di accedere al sito ti&nbsp;chiediamo un minuto per&nbsp;confermare il tuo account</p>\r\n\r\n<p><a href=\"{!! $model-&gt;enable_url !!}\">Clicca qui per confermare il tuo account</a></p>\r\n\r\n<p>In alternativa copia ed incolla sul tuo browser il link che segue</p>\r\n\r\n<p>{!! $model-&gt;enable_url !!}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Successivamente potrai utilizzare le&nbsp;credenziali che riportiamo di seguito</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Email :&nbsp;<strong>{!! $model-&gt;model-&gt;mail !!}</strong></p>\r\n\r\n<p>Password&nbsp;:&nbsp;<strong>{!! $model-&gt;password !!}</strong> (composta da&nbsp;{!! strlen($model-&gt;password) !!} caratteri)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Al primo accesso ti chiediamo cortesemente di completare la tua scheda anagrafica.</p>\r\n\r\n<ul>\r\n	<li>Connetti a te amici,&nbsp;figli, genitori o semplici colleghi.</li>\r\n	<li>Decidi quali informazioni, queste persone, possono vedere su di te</li>\r\n	<li>Visita la tue connessioni o quelle degli altri utenti registrati al sito&nbsp;</li>\r\n	<li>Invita altre persone&nbsp;</li>\r\n	<li>Registra le informazioni dei tuoi cari e facci conoscere la loro storia</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>', 'Questa mail viene inviata all\'utente che si registra sul sito\r\n\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! $model->password !!}</b> per visualizzare la password</li>\r\n<li>Incolla <b>{!! $model->model->mail !!}</b> per visualizzare la mail</li>\r\n<li>Incolla <b>{!! $model->model->name !!}</b> per visualizzare il nome della persona</li>\r\n<li>Incolla <b>{!! $model->model->surname !!}</b> per visualizzare il cognome della persona</li>\r\n<li>Incolla <b>{!! $model->model ? model->model->data_nascita : \'n/a\' !!}</b> per visualizzare la data di nascita della persona</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model->model ? model->model->nome_campo : \'n/a\' !!}</b>.\r\nSostituire <b>nome_campo</b> con i campi che seguono\r\n<br/>\r\n\r\n<li>citta_residenza : citta di residenza della persona</li>\r\n<li>citta_nascita : citta di nascita della persona</li>\r\n<li>tel : Telefono della persona</li>\r\n<li>cf : Codice fiscale della  persona</li>\r\n<li>titolo_di_studio : Titolo di studio della  persona</li>\r\n<li>numeroaborti : numero di aborti della persona</li>\r\n<li>detta : Soprannome della persona</li>\r\n<li>provincia_nascita : Provincia di nascita della persona</li>\r\n<li>provincia_residenza : Provincia di residenza della persona</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona</li>', 'sendToUserAfterRegister'),
(2, '2023-11-24 06:24:20', '2024-01-12 15:10:14', 'from_user_to_friend_on_invite', 'Qualcuno che conosci vuole farti entrare nella rete di LiveForever', '<p><strong>{!! $model-&gt;persona_che_ha_invitato-&gt;nameAndSurname !!}</strong> ti ha inserito nella piattaforma Live Forever come suo&nbsp;&nbsp;&#39;{!! $model-&gt;persona_che_ha_invitato_relazione !!}&#39; in data &#39;{!! date(&quot;d-m-Y&quot;) !!}&#39;.&nbsp;<br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che ci permette di lasciare ai posteri informazioni e consigli su di noi e sulle persone a cui siamo legati.</p>\r\n\r\n<p>Se vuoi puoi entrare nella piattaforma e controllare, confermare o aggiungere informazioni che ti riguardano. Se invece non vuoi che alcuni o tutti i dati che ti riguardano siano pubblici puoi scegliere cosa far vedere.</p>\r\n\r\n<p>Se ti va puoi inoltre ampliare con i tuoi genitori, i tuoi figli, i legami d&#39;amore e di sangue ed eventualmente con gli amici pi&ugrave; cari.</p>\r\n\r\n<p>Il link per entrare in piattaforma &egrave; <a href=\"{!! url(route(&quot;user-accept&quot;,[&quot;id&quot;=&gt;$model-&gt;persona_invitata-&gt;id])) !!}\">www.liveforever.cloud</a></p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail inviata ad utente i cui dati sono stati registrati da un suo amico (padre, madre, figlio, etc..) \r\n\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! url(route(\"user-accept\",[\"id\"=>$model->persona_invitata->id])) !!}</b> mostrare il link per accettare l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->mail !!}</b> per visualizzare la mail della persona che ha ricevuto l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->nome !!}</b> per visualizzare il nome della persona che ha ricevuto l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->cognome !!}</b> per visualizzare il cognome della persona che ha ricevuto l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->data_nascita !!}</b> per visualizzare la data di nascita della persona che ha ricevuto l\'invito</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model->persona_invitata->nome_campo !!}</b>.\r\nSostituire <b>nome_campo</b> con i campi che seguono\r\n<br/>\r\n\r\n<li>citta_residenza : citta di residenza della persona che ha ricevuto l\'invito</li>\r\n<li>citta_nascita : citta di nascita della persona che ha ricevuto l\'invito</li>\r\n<li>tel : Telefono della persona che ha ricevuto l\'invito</li>\r\n<li>cf : Codice fiscale della  persona</li>\r\n<li>titolo_di_studio : Titolo di studio della  persona</li>\r\n<li>numeroaborti : numero di aborti della persona che ha ricevuto l\'invito</li>\r\n<li>detta : Soprannome della persona che ha ricevuto l\'invito</li>\r\n<li>provincia_nascita : Provincia di nascita della persona che ha ricevuto l\'invito</li>\r\n<li>provincia_residenza : Provincia di residenza della persona che ha ricevuto l\'invito</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona che ha ricevuto l\'invito</li>\r\n</p>\r\n\r\n<p>\r\n\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->mail !!}</b> per visualizzare la mail della persona che ha inviato l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->nome !!}</b> per visualizzare il nome della persona che ha inviato l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->cognome !!}</b> per visualizzare il cognome della persona che ha inviato l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->data_nascita !!}</b> per visualizzare la data di nascita della persona che ha inviato l\'invito</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model->persona_che_ha_invitato->nome_campo !!}</b>.\r\nSostituire <b>nome_campo</b> con i campi che seguono\r\n<br/>\r\n\r\n<li>citta_residenza : citta di residenza della persona che ha inviato l\'invito</li>\r\n<li>citta_nascita : citta di nascita della persona che ha inviato l\'invito</li>\r\n<li>tel : Telefono della persona che ha inviato l\'invito</li>\r\n<li>cf : Codice fiscale della  persona</li>\r\n<li>titolo_di_studio : Titolo di studio della  persona</li>\r\n<li>numeroaborti : numero di aborti della persona che ha inviato l\'invito</li>\r\n<li>detta : Soprannome della persona che ha inviato l\'invito</li>\r\n<li>provincia_nascita : Provincia di nascita della persona che ha inviato l\'invito</li>\r\n<li>provincia_residenza : Provincia di residenza della persona che ha inviato l\'invito</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona che ha inviato l\'invito</li>\r\n\r\n</p>', 'sendFromUserToFriendOnInvite'),
(3, '2023-12-07 08:52:43', '2024-01-11 17:14:29', 'user_on_lost_password', 'Accedi a LiveForever con la tua nuova password', '<p>Caro<strong>&nbsp;{!! $model-&gt;model-&gt;nameAndSurname !!}</strong></p>\r\n\r\n<p>Di seguito riportiamo le credenziali per accedere al sito <a href=\"{!! url(route(\'home\')) !!}\">LiveForever</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Email: <strong>{!! $model-&gt;model-&gt;mail !!}</strong></p>\r\n\r\n<p>Password:&nbsp; <strong>{!! $model-&gt;password !!}</strong> (composta da {!! strlen($model-&gt;password) !!} caratteri)</p>\r\n\r\n<p>Ti &egrave; stata inviata questa mail perch&egrave; hai fatto richiesta di una nuova password. Qualora non fossi stato tu a compiere questa azione ti preghiamo di informarci prontamente perch&egrave; probabilmente qualcuno sta tentando di accedere alla tua area riservata</p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>', 'Questa mail arriva all\'utente che ha richiesto una nuova password\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! $model->mail !!}</b> per visualizzare la mail</li>\r\n<li>Incolla <b>{!! $model->name !!}</b> per visualizzare il nome della persona</li>\r\n<li>Incolla <b>{!! $model->surname !!}</b> per visualizzare il cognome della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->data_nascita : \'n/a\' !!}</b> per visualizzare la data di nascita della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->citta_residenza : \'n/a\' !!}</b> per visualizzare la citta di residenza della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->citta_nascita : \'n/a\' !!}</b> per visualizzare la citta di nascita della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->tel : \'n/a\' !!}</b> per visualizzare il numero di telefono della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->cf : \'n/a\' !!}</b> per visualizzare il codice fiscale della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->titolo_di_studio : \'n/a\' !!}</b> per visualizzare il titolo di studio della persona</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model ? $model->nome_campo : \'n/a\' !!}.\r\nSostituire nome_campo con i campi che seguono\r\n<br/>\r\n\r\n<li>numeroaborti : numero di aborti della persona</li>\r\n<li>detta : Soprannome della persona</li>\r\n<li>provincia_nascita : Provincia di nascita della persona</li>\r\n<li>provincia_residenza : Provincia di residenza della persona</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona</li>', 'userOnLostPassword'),
(4, '2023-12-10 09:29:16', '2023-12-10 09:32:30', 'to_user_after_account_disabled', 'Abbiamo provveduto a disabilitare il tuo account', '<p>Testo da decidere</p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail arriva all\'utente a cui è stato disabilitato l\'account\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! $model->mail !!}</b> per visualizzare la mail</li>\r\n<li>Incolla <b>{!! $model->name !!}</b> per visualizzare il nome della persona</li>\r\n<li>Incolla <b>{!! $model->surname !!}</b> per visualizzare il cognome della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->data_nascita : \'n/a\' !!}</b> per visualizzare la data di nascita della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->citta_residenza : \'n/a\' !!}</b> per visualizzare la citta di residenza della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->citta_nascita : \'n/a\' !!}</b> per visualizzare la citta di nascita della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->tel : \'n/a\' !!}</b> per visualizzare il numero di telefono della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->cf : \'n/a\' !!}</b> per visualizzare il codice fiscale della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->titolo_di_studio : \'n/a\' !!}</b> per visualizzare il titolo di studio della persona</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model ? $model->nome_campo : \'n/a\' !!}.\r\nSostituire nome_campo con i campi che seguono\r\n<br/>\r\n\r\n<li>numeroaborti : numero di aborti della persona</li>\r\n<li>detta : Soprannome della persona</li>\r\n<li>provincia_nascita : Provincia di nascita della persona</li>\r\n<li>provincia_residenza : Provincia di residenza della persona</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona</li>', 'sendToUserAfterAccountDisabled'),
(5, '2023-12-10 09:34:05', '2024-01-12 10:13:59', 'to_user_after_account_enabled', 'Abbiamo provveduto ad abilitare il tuo account', '<p>Ciao {!! $model-&gt;nameAndSurname !!}, abbiamo abilitato il tuo account sulla piattaforma Live Forever&nbsp;</p>\r\n\r\n<p><br />\r\nLiveForever &egrave; una piattaforma che ci permette di lasciare ai posteri informazioni e consigli su di noi e sulle persone a cui siamo legati.</p>\r\n\r\n<p>Se vuoi puoi entrare nella piattaforma e controllare, confermare o aggiungere informazioni che ti riguardano. Se invece non vuoi che alcuni o tutti i dati che ti riguardano siano pubblici puoi scegliere cosa far vedere.</p>\r\n\r\n<p>Se ti va puoi inoltre ampliare con i tuoi genitori, i tuoi figli, i legami d&#39;amore e di sangue ed eventualmente con gli amici pi&ugrave; cari.</p>\r\n\r\n<p>Il link per entrare in piattaforma &egrave; www.liveforever.cloud</p>', 'Questa mail arriva all\'utente a cui è stato abilitato l\'account\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! $model->mail !!}</b> per visualizzare la mail</li>\r\n<li>Incolla <b>{!! $model->nomeECognome !!}</b> per visualizzare il nome e cognome della persona</li>\r\n<li>Incolla <b>{!! $model->nome !!}</b> per visualizzare il nome della persona</li>\r\n<li>Incolla <b>{!! $model->cognome !!}</b> per visualizzare il cognome della persona</li>\r\n<li>Incolla <b>{!! $model->data_nascita !!}</b> per visualizzare la data di nascita della persona</li>\r\n<li>Incolla <b>{!! $model->citta_residenza !!}</b> per visualizzare la citta di residenza della persona</li>\r\n<li>Incolla <b>{!! $model->citta_nascita !!}</b> per visualizzare la citta di nascita della persona</li>\r\n<li>Incolla <b>{!! $model->tel !!}</b> per visualizzare il numero di telefono della persona</li>\r\n<li>Incolla <b>{!! $model->cf !!}</b> per visualizzare il codice fiscale della persona</li>\r\n<li>Incolla <b>{!! $model->titolo_di_studio !!}</b> per visualizzare il titolo di studio della persona</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model->nome_campo !!}.\r\nSostituire nome_campo con i campi che seguono\r\n<br/>\r\n\r\n<li>numeroaborti : numero di aborti della persona</li>\r\n<li>detta : Soprannome della persona</li>\r\n<li>provincia_nascita : Provincia di nascita della persona</li>\r\n<li>provincia_residenza : Provincia di residenza della persona</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona</li>\r\n<li>altezza : altezza della persona</li>\r\n<li>peso : Peso della persona </li>', 'sendToUserAfterAccountEnabled'),
(6, '2023-12-29 14:21:19', '2023-12-29 14:21:19', 'to_owner_for_verify_relation', 'C\'è una relazione da verificare', '<p>La relazione &egrave; tra&nbsp;</p>\r\n\r\n<p><strong>{!! $model-&gt;ofPersonaTra()-&gt;first()-&gt;nomeECognome !!}</strong></p>\r\n\r\n<p>e</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>{!! $model-&gt;ofPersonaE()-&gt;first()-&gt;nomeECognome !!}</strong></p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail viene inviata al proprietario del sito per avvisarlo che deve verificare una relazione tra due persone', 'sendToOwnerWhenARelationNeedsToBeVerified'),
(7, '2024-01-11 17:14:09', '2024-01-11 17:14:09', 'user_on_change_password', 'La tua password è cambiata', '<p>Caro<strong>&nbsp;{!! $model-&gt;model-&gt;nameAndSurname !!}</strong></p>\r\n\r\n<p>Di seguito riportiamo le credenziali per accedere al sito <a href=\"{!! url(route(\'home\')) !!}\">LiveForever</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Email: <strong>{!! $model-&gt;model-&gt;mail !!}</strong></p>\r\n\r\n<p>Password:&nbsp; <strong>{!! $model-&gt;password !!}</strong> (composta da {!! strlen($model-&gt;password) !!} caratteri)</p>\r\n\r\n<p>Ti &egrave; stata inviata questa mail perch&egrave; hai fatto richiesta di una nuova password. Qualora non fossi stato tu a compiere questa azione ti preghiamo di informarci prontamente perch&egrave; probabilmente qualcuno sta tentando di accedere alla tua area riservata</p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail viene inviata alla persona dopo avere cambiato la password (viene inviata anche quando è l\'amministratore che la cambia)', 'userOnChangePassword'),
(8, '2024-01-12 16:01:59', '2024-01-12 16:01:59', 'to_user_for_verify_relation', 'Hai una relazione da verificare', '<p>Ciao&nbsp;&nbsp;&nbsp;{!! $model-&gt;persona_invitata-&gt;nomeECognome !!}&nbsp;</p>\r\n\r\n<p>{!! $model-&gt;persona_che_ha_invitato-&gt;nomeECognome !!}&nbsp; sostiene che tu sei suo/sua&nbsp;&nbsp;&nbsp;{!! $model-&gt;persona_invitata_relazione !!}&nbsp;</p>\r\n\r\n<p>e tu per lui/lei sei&nbsp;&nbsp;&nbsp;{!! $model-&gt;persona_che_ha_invitato_relazione !!}&nbsp;</p>\r\n\r\n<p>Ti invitiamo a confermare la relazione&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail viene inviata alla persona che è invitata a confermare una relazione \r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<h3>Dati della relazione</h3>\r\n<li>Incolla  {!! $model->persona_invitata_relazione !!} per mostrare la relazione </li>\r\n<li>Incolla  {!! $model->persona_che_ha_invitato_relazione !!} per mostrare la relazione </li>\r\n</p>\r\n\r\n<p>Dati della persona che indica la relazione </p>\r\n<li>Incolla {!! $model->persona_che_ha_invitato->mail !!}</b> per visualizzare la mail</li>\r\n<li>Incolla {!! $model->persona_che_ha_invitato->nomeECognome !!}</b> per visualizzare il nominativo</li>\r\n<p>Dati della persona che riceve questa mail </p>\r\n\r\n<li>Incolla  {!! $model->persona_invitata->mail !!}  per visualizzare la mail </li>\r\n<li>Incolla  {!! $model->persona_invitata->nomeECognome !!}  per visualizzare la mail </li>', 'sendToUserWhenARelationNeedsToBeVerified'),
(9, '2024-02-02 06:39:02', '2024-02-02 06:48:20', 'to_user_after_email_changed', 'Il tuo indirizzo mail è cambiato', '<p>Ciao <b>{!! $model-&gt;nomeECognome !!}&nbsp;</b>hai cambiato il tuo indirizzo email.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Usa la mail&nbsp;<b>{!! $model-&gt;mail !!}&nbsp;</b> Per eseguire la tua prossima login&nbsp;</p>\r\n\r\n<p>Potrai continuare ad usare la tua vecchia password</p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail arriva all\'utente a cui è stato disabilitato l\'account\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! $model->mail !!}</b> per visualizzare la mail</li>\r\n<li>Incolla <b>{!! $model->nomeECognome !!}</b> per visualizzare il nome completo della persona</li>\r\n<li>Incolla <b>{!! $model->nome !!}</b> per visualizzare il nome della persona</li>\r\n<li>Incolla <b>{!! $model->cognome !!}</b> per visualizzare il cognome della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->data_nascita : \'n/a\' !!}</b> per visualizzare la data di nascita della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->citta_residenza : \'n/a\' !!}</b> per visualizzare la citta di residenza della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->citta_nascita : \'n/a\' !!}</b> per visualizzare la citta di nascita della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->tel : \'n/a\' !!}</b> per visualizzare il numero di telefono della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->cf : \'n/a\' !!}</b> per visualizzare il codice fiscale della persona</li>\r\n<li>Incolla <b>{!! $model ? $model->titolo_di_studio : \'n/a\' !!}</b> per visualizzare il titolo di studio della persona</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model ? $model->nome_campo : \'n/a\' !!}.\r\nSostituire nome_campo con i campi che seguono\r\n<br/>\r\n\r\n<li>numeroaborti : numero di aborti della persona</li>\r\n<li>detta : Soprannome della persona</li>\r\n<li>provincia_nascita : Provincia di nascita della persona</li>\r\n<li>provincia_residenza : Provincia di residenza della persona</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona</li>', NULL),
(10, '2024-02-02 06:39:54', '2024-02-02 06:39:54', 'to_user_after_email_changed_an', 'La tua email e la tua nuova password', '<p>Ciao hai modificato le credenziali di accesso.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL),
(11, '2024-02-10 00:07:50', '2024-02-10 00:07:50', 'from_user_to_friend_on_rsc', 'Una persona che conosci ci ha segnalato il tuo nome', '<p><strong>{!! $model-&gt;persona_che_ha_invitato-&gt;nameAndSurname !!}</strong> ti ha inserito nella piattaforma Live Forever come suo&nbsp;&nbsp;{!! $model-&gt;persona_invitata_relazione !!}&nbsp;in data {!! date(&quot;d-m-Y&quot;) !!}.&nbsp;<br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che ci permette di lasciare ai posteri informazioni e consigli su di noi e sulle persone a cui siamo legati.</p>\r\n\r\n<p>Se vuoi puoi entrare nella piattaforma e controllare, confermare o aggiungere informazioni che ti riguardano. Se invece non vuoi che alcuni o tutti i dati che ti riguardano siano pubblici puoi scegliere cosa far vedere.</p>\r\n\r\n<p>La tua email &egrave; :&nbsp;&nbsp;{!! $model-&gt;persona_invitata-&gt;mail !!}</p>\r\n\r\n<p>La tua password &eacute; : {!! $model-&gt;password !!}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Se ti va puoi inoltre ampliare con i tuoi genitori, i tuoi figli, i legami d&#39;amore e di sangue ed eventualmente con gli amici pi&ugrave; cari.</p>\r\n\r\n<p>Il link per entrare in piattaforma &egrave; <a href=\"https://www.liveforever.cloud\">www.liveforever.cloud</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n\r\n\r\n\r\n<p><br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Questa mail inviata ad utente i cui dati sono stati registrati da un suo amico (padre, madre, figlio, etc..) \r\n\r\n<p>\r\n<h4>Di seguito i suggerimenti per chi compila questa mail</h4>\r\nPotete inserire dati dinamici alla persona con la sintassi : {!! espressione !!}\r\n<ul>\r\n<li>Incolla <b>{!! $model->password !!}</b> per visualizzare la password generata per l\'utente</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->mail !!}</b> per visualizzare la mail della persona che ha ricevuto l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->nome !!}</b> per visualizzare il nome della persona che ha ricevuto l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->cognome !!}</b> per visualizzare il cognome della persona che ha ricevuto l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_invitata->data_nascita !!}</b> per visualizzare la data di nascita della persona che ha ricevuto l\'invito</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model->persona_invitata->nome_campo !!}</b>.\r\nSostituire <b>nome_campo</b> con i campi che seguono\r\n<br/>\r\n\r\n<li>citta_residenza : citta di residenza della persona che ha ricevuto l\'invito</li>\r\n<li>citta_nascita : citta di nascita della persona che ha ricevuto l\'invito</li>\r\n<li>tel : Telefono della persona che ha ricevuto l\'invito</li>\r\n<li>cf : Codice fiscale della  persona</li>\r\n<li>titolo_di_studio : Titolo di studio della  persona</li>\r\n<li>numeroaborti : numero di aborti della persona che ha ricevuto l\'invito</li>\r\n<li>detta : Soprannome della persona che ha ricevuto l\'invito</li>\r\n<li>provincia_nascita : Provincia di nascita della persona che ha ricevuto l\'invito</li>\r\n<li>provincia_residenza : Provincia di residenza della persona che ha ricevuto l\'invito</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona che ha ricevuto l\'invito</li>\r\n</p>\r\n\r\n<p>\r\n\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->mail !!}</b> per visualizzare la mail della persona che ha inviato l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->nome !!}</b> per visualizzare il nome della persona che ha inviato l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->cognome !!}</b> per visualizzare il cognome della persona che ha inviato l\'invito</li>\r\n<li>Incolla <b>{!! $model->persona_che_ha_invitato->data_nascita !!}</b> per visualizzare la data di nascita della persona che ha inviato l\'invito</li>\r\n</ul>\r\n</p>\r\n<p>Ci sono altri campi che possono essere visualizzati con la sintassi <b>{!! $model->persona_che_ha_invitato->nome_campo !!}</b>.\r\nSostituire <b>nome_campo</b> con i campi che seguono\r\n<br/>\r\n\r\n<li>citta_residenza : citta di residenza della persona che ha inviato l\'invito</li>\r\n<li>citta_nascita : citta di nascita della persona che ha inviato l\'invito</li>\r\n<li>tel : Telefono della persona che ha inviato l\'invito</li>\r\n<li>cf : Codice fiscale della  persona</li>\r\n<li>titolo_di_studio : Titolo di studio della  persona</li>\r\n<li>numeroaborti : numero di aborti della persona che ha inviato l\'invito</li>\r\n<li>detta : Soprannome della persona che ha inviato l\'invito</li>\r\n<li>provincia_nascita : Provincia di nascita della persona che ha inviato l\'invito</li>\r\n<li>provincia_residenza : Provincia di residenza della persona che ha inviato l\'invito</li>\r\n<li>occupazioneItaliano : Occupazione in italiano della persona che ha inviato l\'invito</li>\r\n\r\n</p>', 'sendFromUserToFriendOnRelationSelfConfirmedUnsafed'),
