(279, '2024-05-11 09:07:07', '2024-05-11 09:07:07', 'francesco.bersani@justagency.it', 'Qualcuno che conosci vuole farti entrare nella rete di LiveForever', '<p><strong>Francesco, Protano</strong> ti ha inserito nella piattaforma Live Forever come suo&nbsp;&nbsp;&#39;Amicone&#39; in data &#39;11-05-2024&#39;.&nbsp;<br />\r\n<strong>LiveForever </strong>&egrave; una piattaforma che ci permette di lasciare ai posteri informazioni e consigli su di noi e sulle persone a cui siamo legati.</p>\r\n\r\n<p>Se vuoi puoi entrare nella piattaforma e controllare, confermare o aggiungere informazioni che ti riguardano. Se invece non vuoi che alcuni o tutti i dati che ti riguardano siano pubblici puoi scegliere cosa far vedere.</p>\r\n\r\n<p>Se ti va puoi inoltre ampliare con i tuoi genitori, i tuoi figli, i legami d&#39;amore e di sangue ed eventualmente con gli amici pi&ugrave; cari.</p>\r\n\r\n<p>Il link per entrare in piattaforma &egrave; <a href=\"https://www.liveforever.cloud/public/index.php/webapp/user/accept/536\">www.liveforever.cloud</a></p>\r\n\r\n<p>&nbsp;</p>', 'fprotano@yahoo.com', 'info@liveforever.cloud', 'info@liveforever.cloud'),
(280, '2024-05-13 13:59:34', '2024-05-13 13:59:34', 'gammarotacarla@gmail.com', 'Ti sei registrato su LiveForever', '<p>Ciao<strong>&nbsp;Carla, Gammarota</strong></p>\r\n\r\n<p>Prima di accedere al sito ti&nbsp;chiediamo un minuto per&nbsp;confermare il tuo account</p>\r\n\r\n<p><a href=\"https://www.liveforever.cloud/webapp/user/enable/5ea1649a31336092c05438df996a3e59\">Clicca qui per confermare il tuo account</a></p>\r\n\r\n<p>In alternativa copia ed incolla sul tuo browser il link che segue</p>\r\n\r\n<p>https://www.liveforever.cloud/webapp/user/enable/5ea1649a31336092c05438df996a3e59</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Successivamente potrai utilizzare le&nbsp;credenziali che riportiamo di seguito</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Email :&nbsp;<strong>gammarotacarla@gmail.com</strong></p>\r\n\r\n<p>Password&nbsp;:&nbsp;<strong>mauro</strong> (composta da&nbsp;5 caratteri)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Al primo accesso ti chiediamo cortesemente di completare la tua scheda anagrafica.</p>\r\n\r\n<ul>\r\n	<li>Connetti a te amici,&nbsp;figli, genitori o semplici colleghi.</li>\r\n	<li>Decidi quali informazioni, queste persone, possono vedere su di te</li>\r\n	<li>Visita la tue connessioni o quelle degli altri utenti registrati al sito&nbsp;</li>\r\n	<li>Invita altre persone&nbsp;</li>\r\n	<li>Registra le informazioni dei tuoi cari e facci conoscere la loro storia</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>LiveForever </strong>&egrave; una piattaforma che mira a contenere le informazioni non sensibili di tutti gli abitanti del pianeta e le correlazioni tra di essi.&nbsp;</p>', 'fprotano@yahoo.com', 'info@liveforever.cloud', 'noreply@liveforever.cloud'),
