(1, 1, NULL, NULL, 'Mauro', 'Pompetti', 'M', '1961-08-28', NULL, 'Forlì', 'fc', 'Italia', 'mauro.pompetti@gmail.com', '3296353404', '2023-12-05 12:43:28', '2024-06-16 14:56:02', 53, 1, NULL, 'Foggia', 'fg', 'Italia', 'http://www.dpmelettronica.it/', NULL, NULL, NULL, 'Vid00000001-001.mp4', NULL, 'Insegnante- Inventore - Ceo', NULL, 'Ingegneria nucleare', NULL, '1101101111111101001101111', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, NULL, 1, 3, 'fe01ce2a7fbac8fafaed7c982a04e229', 1, 0, 1, '187', '83', 1, 'Capire come funzionano le cose, in particolare la natura, la tecnologia, il corpo e la mente umana. Mi emoziona vedere risultati importanti prodotti dagli esseri viventi (un opera d\'arte, un saggio di danza, un aereo, un astronave..)', 'A progettare sistemi complessi innovativi, a progettare dispositivi elettronici, a generare il relativo software, a fare prototipi. A concretizzare le idee.', 'Che ogni individuo sia aiutato a seguire la sua vocazione e pensi al proprio lavoro come una piacevole missione.', 'Mi viene naturale capire i processi matematici e fisici che governano l\'universo e quindi per me la tecnologia è una disciplina che comprendo senza sforzo.', 3, '2024-05-01 13:56:36', NULL, NULL, NULL),
