INSERT INTO `role` (`id`, `name`, `description`, `flag_default_from_fe`, `flag_default_from_fe_for_users`, `flag_default_from_fe_for_seo`) VALUES
(1, 'Amministratore (può fare tutto)', NULL, 0, 0, 0),
(2, 'Archivista dello staff', 'Sono coloro abilitati a inserire e modificare tutti i dati ed i collegamenti, a gestire le segnalazioni di errore, correggere ed eliminare profili disturbatori o duplicati, prendere parte alla strategia della piattaforma. Sono gli unici che possono accedere al back office ed eseguire qualunque operazione.', 0, 0, 0),
(3, 'Archivista junior', 'Sono coloro che si registrano in maniera completa mail verificata, telefono verificato, codice fiscale verificato, foto e fanno domanda di contribuire alla piattaforma. Se accettati possono inserire tutti senza alcuna limitazione. Hanno sempre autorizzazione di inserire nuovi membri e di modificare collegamenti e dati. Non possono agire su profili e collegamenti non inseriti da loro. Contribuiscono a risolvere le dispute su dati inseriti da loro, abilitano gli utenti che rivendicano il loro profilo e di cui non era stata inserita la mail.', 0, 0, 0),
(4, 'Amministratore', 'Sono coloro che si registrano in maniera completa mail verificata, telefono verificato, codice fiscale verificato, foto e poi possono inserire la loro famiglia ed i loro amici. Hanno sempre autorizzazione di inserire nuovi membri collegati ad essi e di modificare collegamenti e dati. Non possono agire su profili e collegamenti non inseriti da loro.', 0, 0, 0),
(5, 'Utente da verificare', 'Utente registrato tramite motore di ricerca che deve essere verificato', 0, 0, 1),
(6, 'Utente senza accesso', 'Utente che non ha accesso al sito', 0, 0, 0),
(7, 'Utente', 'utente normale', 1, 0, 0);
